B.beu=new A.a("D\xe9collement post<10mm =>300ml.\nD\xe9collement post 10-20mm+/-circonferentiel => 300-500\nD\xe9collement post>20mm => >500ml\nPericarde ne passe jamais derriere Ao desc: diff\xe9rencier de epanchement pleural\nCompression parois libre OD. puis compression collapsus du VD: en diastole, surtout ch de chasse VD (paroi + fine).  puis Plethore VCI Dilatation >20mm + Absence de variation resp. puis Compression OG: tardif, inconstant  \nDilatation VD <0.5:N 0.6-1: mod\xe9r\xe9 >1 Sev\xe8re\nVCI: Collapsus (Dmax-Dmin)/Dmax POD>10mmHg si Collapsus <50%\nEn VC distensibilit\xe9 VCI a 3cm OD>12%\n",null,null,B.a0,null,null,null,null,null,null)
