B.bbe=new A.a("L\u2019excursion systolique du plan de l\u2019anneau tricuspide (TAPSE) est un param\xe8tre de fonction longitudinale d\u2019acquisition simple sur un tir TM au niveau de l\u2019anneau tricuspide. Un TAPSE <18mm refl\xe8te une dysfonction mod\xe9r\xe9e alors qu\u2019un TAPSE <8,5mm refl\xe8te une dysfonction s\xe9v\xe8re du VD (FEVD inf\xe9rieure \xe0 25%).\nLe pic de l\u2019ondeS en mode Doppler tissulaire puls\xe9 \xe0 l\u2019anneau tricuspide explore \xe9galement la contraction longitudinale du VD. Le pic de S est bien corr\xe9l\xe9 avec la mesure de la fonction VD par IRM cardiaque. Un pic de S inf\xe9rieur \xe0 11,5 cm/s signe l\u2019existence d\u2019une dysfonction ventriculaire droite (FEVD < 45 %) avec une sensibilit\xe9 de 90 % et une sp\xe9cificit\xe9 de 85 %\n",null,null,B.a0,null,null,null,null,null,null)
