B.aTN=new A.ab("      Diff\xe9rentes \xe9tapes du processus\n      \n      En premi\xe8re intention, rechercher une cause m\xe9canique \xe0 l\u2019obstruction :\n      -Coudure du DIVLD ou de la tubulure\n      -Robinet ferm\xe9\n      -D\xe9placement du PICC (nombre de rep\xe8re ext\xe9rioris\xe9)\n      -D\xe9placement de l\u2019aiguille de huber (CCI)\n      \n      Faire une Radiographie pour \xe9liminer\n      - d\xe9sinsertion KT\n      - migration dans les cavit\xe9s cardiaques\n      - section du KT dans la pince costo-claviculaire\n      - Discuter d'une opacification du DIVLD\n      \n      -En l'absence de probl\xe8me m\xe9canique, si obstruction est confirm\xe9e, passer \xe0 l'\xe9tape suivante\n      \n      \n      Si la cause m\xe9canique est exclue, injecter en pressions douces 10 ml de s\xe9rum physiologique \xe0 0.9% et r\xe9aspirer (r\xe9p\xe9ter les man\u0153uvres d\u2019aspirations plusieurs fois pendant 15 min).\n      Quand l\u2019obstruction persiste, SUR PRESCRIPTION MEDICALE, utiliser l\u2019ACTILYSE\xae.\n      \n      Mat\xe9riel \xe0 pr\xe9parer pour Actilyse\n      -ACTILYSE \xae : 1 flacon dos\xe9 \xe0 10 mg de poudre + un flacon de 10 ml de solvant disponible \xe0 la pharmacie (ou Urokinase 100 000UI Flacon)\n      -1 seringue de 10 ml pour reconstituer le produit\n      -1 trocard\n      -1 seringue \xe0 verrou, de 10 ml\n      - Compresses st\xe9riles\n      - Antiseptique alcoolique\n      - SHA\n      \n      D\xe9roulement du soin avec Actilyse\n      -Reconstituer la solution : dissoudre la poudre ACTILYSE \xae 10 mg avec les 10 ml du solvant fourni, on obtient ainsi une solution de 10 ml d\u2019 ACTILYSE \xae dos\xe9e \xe0 1mg/ml.\n      -Pr\xe9lever de fa\xe7on aseptique 2 ml de cette solution dans la seringue \xe0 verrou. Mettre le reste de la solution au r\xe9frig\xe9rateur en indiquant la date et l\u2019heure de reconstitution ; la conservation ne devra pas d\xe9passer 24 h.\n      -Effectuer une friction des mains avec du SHA.\n      -D\xe9sinfecter la valve bidirectionnelle avec des compresses st\xe9riles imbib\xe9es d\u2019antiseptique alcoolique.\n      -Clamper le DIVLD\n      -Adapter la seringue au niveau de la valve bidirectionnelle, d\xe9clamper et tenter d\u2019injecter une petite quantit\xe9 (0,1 \xe0 0,2 ml) de la solution, et laisser la seringue en place.\n      -Attendre 10 mn, puis r\xe9aspirer.\n      -Si le syst\xe8me n\u2019est pas d\xe9bouch\xe9, tenter d\u2019injecter \xe0 nouveau de l\u2019 ACTILYSE \xae comme pr\xe9c\xe9demment. Attendre encore 10 mn avant de r\xe9aspirer\n      -Renouveler l\u2019op\xe9ration toutes les 10 mn et pendant 1 h maximum.\n      \n      L\u2019 ACTILYSE \xae agissant par contigu\xeft\xe9, il est imp\xe9ratif de respecter le temps d\u2019action n\xe9cessaire d\u2019action qui peut \xeatre tr\xe8s long. Une infime partie du produit est suffisante pour agir. D\xe9s que le DIVLD est d\xe9sobstru\xe9, r\xe9 aspirer l\u2019 ACTILYSE\xae puis faire un rin\xe7age puls\xe9 au s\xe9rum physiologique.\n      -Si au bout d\u20191 heure, le cath\xe9ter n\u2019est toujours pas fonctionnel, le clamper, retirer la seringue, d\xe9sinfecter la valve bidirectionnelle et r\xe9adapter la perfusion.\n      -Informer le m\xe9decin de la situation.\n      -Attendre entre 1 et 3 h. et v\xe9rifier \xe0 nouveau la perm\xe9abilit\xe9 du catheter.\n      S\u2019il n\u2019est toujours pas d\xe9bouch\xe9, continuer \xe0 v\xe9rifier la perm\xe9abilit\xe9 du syst\xe8me de temps en temps et jusqu\u2019\xe0 24 h apr\xe8s l\u2019injection d\u2019 ACTILYSE\xae. Le d\xe9lai d\u2019efficacit\xe9 pouvant varier de 15 mn \xe0 quelques heures, voire 24 heures apr\xe8s l\u2019injection.\n      \n      Tracer dans le dossier de soins infirmiers ainsi que sur la fiche de tra\xe7abilit\xe9 sp\xe9cifique au dispositif.\n      \n      \n      MATERIEL pour Urokinase\n      \n      - ACTOSOLV UROKINASE\xae 100 000 UI : 1 flacon de poudre (\xe0 reconstituer)\n      - 1 ampoule de 10 ml d\u2019eau pour pr\xe9paration injectable (EPPI)\n      - 2 ampoules de 10 ml de NaCl 0,9%\n      - 1 aiguille de Huber\n      - 2 seringues de 10 ml\n      - 1 poche de solut\xe9 de perfusion\n      \n      D\xe9roulement du soin avec Urokinase\n      - reconstituer le flacon d\u2019Urokinase\xae avec 2 ml d\u2019EPPI (seringue de 2 ml) : bien dissoudre la poudre\n      - pr\xe9lever avec une seringue de 10 ml les 2 ml de la solution pr\xe9c\xe9dente reconstitu\xe9e\n      - compl\xe9ter \xe0 10 ml avec du NaCl 0,9% et m\xe9langer doucement : la solution de 10 ml obtenue est \xe0 une concentration de 10 000 UI / ml\n      - reperfuser le patient sur son DIVLD avec une nouvelle aiguille de Huber pr\xe9alablement purg\xe9e avec 1 ml de la solution d\u2019Urokinase \xe0 10 000 UI/ml\n      - injecter 1 \xe0 3 ml dans la chambre implantable, selon les possibilit\xe9s\n      - apr\xe8s l\u2019injection, attendre 15 \xe0 30 minutes\n      - v\xe9rifier si le reflux sanguin est obtenu :\n      \n      > Si OUI : \n      - enlever la seringue d\u2019Urokinase\xae\n      - rincer avec une seringue de 10 ml de NaCl 0,9%\n      - mettre en place un solut\xe9 de perfusion pour rin\xe7age abondant\n      \n      > Si NON : \n      - r\xe9-injecter de nouveau 1 \xe0 3 ml d\u2019Urokinase\xae si le reflux n\u2019est pas obtenu\n      - renouveler la proc\xe9dure jusqu\u2019\xe0 4 injections maximum\n      - d\xe8s que le reflux est obtenu, arr\xeater les injections d\u2019Urokinase\xae                              \n                    ",null,null,B.y,null)
