B.b9w=new A.a("Maladie fr\xe9quente +++ y compris dans le 77 \nSignes variables selon atteinte \n    \u2022\tAlt\xe9ration de l\u2019\xe9tat g\xe9n\xe9ral (asth\xe9nie anorexie amaigrissement), fi\xe8vre variable souvent nocturne, sueurs nocturnes \n    \u2022\tToux \n    \u2022\tAd\xe9nopathies cervicales ou profondes \n    \u2022\tLeucocyturie sans germe, s\xe9rite lymphocytaire (pl\xe8vre, ascite, p\xe9ricarde) \n    \u2022\tM\xe9ningite lymphocytaire hypoglycorachique hyperproteinorachique (PL 20 gouttes et mesurer la glyc\xe9mie capillaire en m\xeame temps !) \n    \u2022\tSpondylodiscite (Mal de Pott) \n    \u2022\tMais TOUTES LES LOCALISATIONS SONT POSSIBLES !  (r\xe9nale, pelvienne, digestive, etc \u2026) \n    \u2022\tFormes diss\xe9min\xe9es fr\xe9quentes chez les immunod\xe9prim\xe9s (surtout au stade SIDA pour les patients vivants avec le VIH) \n\nPatient originaire de zone de forte end\xe9micit\xe9 tuberculeuse (Afrique subsaharienne, Asie, Maghreb, Am latine, Europe de l\u2019Est notamment) \nR\xe9activation de tuberculose latente chez les immunod\xe9prim\xe9s (VIH, transplant\xe9s, diab\xe9tiques, dialys\xe9s) et pr\xe9caires (SDF, milieu carc\xe9ral, etc\u2026) \nou expos\xe9s r\xe9cemment contage <2 ans \n\nContagiosit\xe9 par voie a\xe9rienne +++ : forme pulmonaire, et/ou pleurale et/ou laryng\xe9e\nDogmes : \n    \u2022\ttoute pneumopathie excav\xe9e doit faire rechercher une tuberculose\n    \u2022\ttoute suspicion de tuberculose et tuberculose confirm\xe9e  doit conduire \xe0 r\xe9aliser une s\xe9rologie VIH de d\xe9pistage, d\xe9pister un diab\xe8te \n    \u2022\ttoute suspicion de tuberculose doit \xeatre mise en isolement AIR le temps d\u2019avoir \xe9limin\xe9 une tuberculose pulmonaire bacillif\xe8re\n    \u2022\tPatient les plus \xe0 risque de tuberculose r\xe9sistante : patient ayant d\xe9j\xe0 \xe9t\xe9 trait\xe9 pour une tuberculose, patients originaire d\u2019Europe de l\u2019Est ( pr\xe9venir le laboratoire dect 6160) \n    \u2022\tUne PCR BK n\xe9gative n\u2019\xe9limine pas le diagnostic de tuberculose \n",null,null,null,null,null,null,null,null,null)
B.b2Z=new A.a("Bilan pr\xe9 th\xe9rapeutique :",null,B.M,null,null,null,null,null,null,null)
B.bnX=new A.a("    \u2022\tNFS plaquettes, cr\xe9atin\xe9mie et calcul du DFG, ASAT ALAT GGT PAL bilirubine totale,  s\xe9rologies VIH/VHB/VHC\n    \u2022\tbetahcg le cas \xe9ch\xe9ant\n    \u2022\tBk crachats sur 3 jours (tubages si ne crache pas) \n    \u2022\tBU / ECBU si leucocyturie faire recherche de BK urine\n    \u2022\tTout pr\xe9l\xe8vement profond (biopsie, LCR, pleural\u2026) doit \xeatre envoy\xe9 en MYCOBACTERIOLOGIE ET ANATOMOPATHOLOGIE \n    \u2022\tChez les immunod\xe9prim\xe9s faire une recherche de mycobact\xe9rie dans le sang (h\xe9moculture)\n    \u2022\tAvis sp\xe9cialis\xe9 urgent \n        o\ten cas d\u2019insuffisance r\xe9nale et/ou h\xe9patique avant ou sous traitement \n        o\tEn cas de m\xe9ningite, dont avis r\xe9a si troubles de la vigilance > d\xe9parasitage par ivermectine (anguillulose) adapt\xe9 au poids ( cf Vidal) avant corticoth\xe9rapie\n        o\tSuspicion ou confirmation d\u2019une  Tuberculose r\xe9sistante ( MDR / XDR )\n",null,null,null,null,null,null,null,null,null)
