B.bnJ=new A.a("1.  Types d'Urgences",null,B.M,null,null,null,null,null,null,null)
B.b_b=new A.a("- Urgences M\xe9taboliques\n  - Syndrome de Lyse Tumorale\n  - Hypercalc\xe9mie\n\n- Urgences Infiltratives\n  - Leuc\xe9mies Hyperleucocytaires / Leucostase\n  - Compression Mediastinale / Compression Autres\n\n- Urgences Cytop\xe9niques:\n  - Thrombop\xe9nie / Sd de Consommation (CIVD)\n  - Neutrop\xe9nie => Neutrop\xe9nie F\xe9brile\n",null,null,null,null,null,null,null,null,null)
B.bjS=new A.a("2.\tSyndrome de Lyse Tumorale (SLT):",null,B.M,null,null,null,null,null,null,null)
B.bb1=new A.a("D\xe9finition:\n  HyperUric\xe9mie => Augmentation de plus de 25%\n  HyperKali\xe9mie => Augmentation de plus de 25%\n  HyperPhsophor\xe9mie => Augmentation de plus de 25%\n  HypoCalc\xe9mie => Diminution de plus de 25%\n\nFacteurs D\xe9clenchants:\n- Chimioth\xe9rapie cycles d\xe9pendants\n  - Anthracycline\n  - Methotrexate\n  - Etoposide\n  - Inhibiteur des topoisom\xe9rases II\n\n- Corticoth\xe9rapie m\xeame \xe0 faible doses dans les pathologies lympho\xefdes\n\n- Th\xe9rapies Cibl\xe9es\n  - Ac Monoclonaux\n  - Petites Mol\xe9cule (ITK,...)\n\nFacteur de risque:\n  - LDL \xe9lev\xe9 avant chimioth\xe9rapie ( croissance rapide)\n\nParticulairt\xe9 du SLT spontan\xe9\n  - Hyperuric\xe9mie et \xe9l\xe9vation des LDL constantes\n  - Asence fr\xe9quente d'hyperphosphat\xe9mie\n  - Insuffisance r\xe9nale aigue possible (n\xe9phropathie urique)\n  - Absence d'hyperkali\xe9mie\n\n  En cas Hypokali\xe9mie et hypophosphor\xe9mie sont fr\xe9quente:\n    - Signe de gravit\xe9\n    - T\xe9moins du renouvellement celllulaire rapide et de la forte masse tumorale\n    - Ne pas corriger en raison du risque d'hyperkal\xe9imie et d'hyperphosphor\xe9mie lors de la lyse tumorale\n\nControle de hyperUric\xe9mie\n  - Augmentation \xe9limination par Hyperdiur\xe8se ( non alcaline pour \xe9viter pr\xe9cipitation de Calcium et Phosphates (risque de nephrocalcinose))\n  - Diminituion de production par Allopurinol (Zyloric)\n    - Per os \xe0 fortes doses\n    - Action lente\n    - Absence \xe9fficacit\xe9 sur les d\xe9pots d'acide urique constitu\xe9s (SLT spontan\xe9)\n  - Uricolyse par Rasburicase (Urate oxydase recombinante) : Fasturtec  \n    - Efficacit\xe9 sup\xe9reiur \xe0 Allopurinol\n    - Rapidement efficace\n    - Destruction des d\xe9pots pr\xe9form\xe9s\n    - Elimination urinaire\n    - Effets secondaires: Bronchospasme, m\xe9th\xe9moglobin\xe9mie\n    - CI en cas de d\xe9ficit en G6-PD\n    - 0.20mg/kg/j J1-J5 voir J7\n\nInsuffisance r\xe9nale aigue\n  - 16-39% des SLT\n  - R\xe9cup\xe9ration excellente \xe0 100% mais parfois lente\n  - Aggrave le pronostique h\xe9matologique\n\nPr\xe9vention:\n  - Hydrataiton et hyperdiur\xe8se\n  - NaCl 0.9% 3l/m\xb2/j selon tol\xe9rance\n  - Hyporuric\xe9miant si FDR mod\xe9r\xe9 voir Fasturtec\n  -EER prophjylactique dans les burkitt\n  - Chimioth\xe9rapie progressive\n    - Hydrea dans les LAM\n    - Corticoide dans les LAL\n                          ",null,null,null,null,null,null,null,null,null)
B.b4P=new A.a("3.\tSyndrome de Leucostase",null,B.M,null,null,null,null,null,null,null)
B.b4k=new A.a("Reflet du syndrome tumorale\nRisque corr\xe9l\xe9 au nombre de Gb\nRisque LAM > LAL\n\n\nSyndrome de Leucostase pulmonaire\n  -Alerte: Baisse Sao2 tr\xe8s mod\xe9r\xe9, DYspn\xe9e mod\xe9r\xe9e \n  -Jusqu'au tableau de d\xe9tresse respiratoire aigue d'installation brutale\n  -Ne pas se fier \xe0 la PaO2 sur Gaz du sang car consommation intra tube\n\nSyndrome de Leucostase Cerebrale\n  - Troubles neurologiques: Le plus souvent frustre: Leuteur d'id\xe9ation => Coma\n\n\nFacteurs Favorisants\n  - Type LAM : Contingent Monocytaire (LAM4 ou 5)\n  - Stase vasculaire : Transfusion globulaires; Savoir ne aps trnasfuser en CG une LAM hyperleucocytaire\n  \nTTT etiologique urgent:\n  - Chimioth\xe9rapie cytotoxique\n  - D\xe9but progressif si possible\n    -Si LAM:\n      -Hydroxyur\xe9e (Hydr\xe9a) y compris \xe0 forte doses 50-75mg/kg/j puis dans un deuxi\xe8me temps chimioth\xe9rapie IV (7 + 3: 7j de cytarabine et 3j d'anthracycline)\n      -Chimiot\xe9hrapie d'embl\xe9e: AraC IVSE first/ Demi-dose Anthracyclines)\n    -Si LAL: Corticost\xe9roide (fractionner les premi\xe8res doses) Ex Dexam\xe9thasone 10mg/8h\n\n  + Support d'organce:\n    - O2 voir ventilation\n    - Eviter trnasfusion de CG sauf si urgence vitale\n    - Attention \xe0 la surcharge\n    - TTT de la CIVD / Thrombop\xe9nie = Miantenir pq \xe9lev\xe9es en pr\xe9vention de l'h\xe9morragie intra alv\xe9olaire secondaire\n    - CT (Dexam\xe9thasone): Diminuer l'activation cytokinique locale  \n  \n                            ",null,null,null,null,null,null,null,null,null)
B.b3M=new A.a("4.\tCIVD : ",null,B.M,null,null,null,null,null,null,null)
B.bts=new A.a("Definition:\n- Consommation des facteurs\n  - Baisse TP\n  - Majoration TCA (baisse facteur VIII)\n  - Baisse facteur II et V\n  - Baisse fibrinog\xe8ne\n\n- Consommation des plaquettes\n- Activation syst\xe8me fibrinolytique\n  - Augmentation PDF\n  - Pr\xe9sence monom\xe8re de fibrine et produits de d\xe9gradation: D-dim\xe8re + et Complexes solubles+\n\nTTT:\n  - Etiologique +++\n    -Chimiot\xe9hrapie\n    -ATRA: Acide tout trans r\xe9tino\xefque dans la LAM3\n  \n  - Substitutif et preventif \n    - Substitutif\n      - Transfusion de pq (>50 000/mm3): en r\xe9alit\xe9 10 000 \xe0 20 000/mm3 en pr\xe9ventif si h\xe9morragie >50 000/mm3 \n      -PFC (Fg>1g/l) voire Concentr\xe9 de Fibrinog\xe8ne\n    -Pr\xe9ventif\n      - Pas de b\xe9n\xe9fice d\xe9montr\xe9 \xe0 l'H\xe9parine\n      - Eviter geste invasif\n",null,null,null,null,null,null,null,null,null)
