B.Lt=new A.a("Etude majes tec-1 : teclistamab en monoth\xe9rapie :  \n-SRC dans 71.5% des cas (1 seul GRADE 3, utilisation tocilisumab 36%)\n-Neurotoxicit\xe9 dans 12.7% des cas (ICANS 3%, aucun grade 3-4)\n-infections dans 76% des cas (45% grade 3, 4)\n",null,null,null,null,null,null,null,null,null)
B.JE=new A.a("1.\tLe Syndrome de relargage des cytokines (SRC) ",null,B.az,null,null,null,null,null,null,null)
B.Lm=new A.a("Le SRC doit \xeatre identifi\xe9 \xe0 partir de manifestations cliniques. Les signes et sympt\xf4mes cliniques du SRC sont non sp\xe9cifiques peuvent inclure, sans s\u2019y limiter, une fi\xe8vre, une hypoxie, des frissons, une hypotension, une tachycardie, une c\xe9phal\xe9e et une \xe9l\xe9vation des enzymes h\xe9patiques. Les   complications du SRC pouvant potentiellement mettre en jeu le pronostic vital peuvent inclure un dysfonctionnement cardiaque, un syndrome de d\xe9tresse respiratoire de l\u2019adulte, une toxicit\xe9 neurologique, une insuffisance r\xe9nale et/ou h\xe9patique et une coagulation intravasculaire diss\xe9min\xe9e (CIVD).\n\nLes patients doivent \xeatre \xe9valu\xe9s et trait\xe9s, en m\xeame temps, pour les autres causes de fi\xe8vre, d\u2019hypoxie et d\u2019hypotension\n\nUn bilan biologique (NFS, Ionogramme, CRP, procalcitonine, bilan h\xe9patique, TP TCA fibrinog\xe8ne, D- Dim\xe8res, schizocytes, troponine, BNP, h\xe9mocultures coupl\xe9es, ECBU) doit \xeatre fait devant toute sympt\xf4mes suspecte de SRC.\n\nL\u2019utilisation du  G-CSF est susceptible d\u2019aggraver les sympt\xf4mes du SRC et doit \xeatre \xe9vit\xe9e pendant le SRC.\n\n",null,null,null,null,null,null,null,null,null)
B.abH=new A.w("Tableau 2 : Prise en charge de SRC","assets/images/pathologies/hematologie/teclistamab/tableau2.png",null)
B.r8=new A.L(B.m,null,null,B.abH,null)
B.JV=new A.a("2.\tSyndrome de neurotoxocit\xe9 associ\xe9 aux cellules effectrices immunitaires (ICANS)",null,B.az,null,null,null,null,null,null,null)
B.KT=new A.a("D\xe9finition : enc\xe9phalopathie toxique avec des sympt\xf4mes de c\xe9phal\xe9es l\xe9g\xe8res, de confusion et de d\xe9lire; aphasie de Broca; crises d'\xe9pilepsie occasionnelles; et rarement, \u0153d\xe8me c\xe9r\xe9bral; peut se produire en pr\xe9sence ou en l'absence de SRC syst\xe9mique. La symptomatologie clinique est h\xe9t\xe9rog\xe8ne allant de sympt\xf4mes peu graves rapidement r\xe9versibles (troubles de l\u2019attention, de l\u2019\xe9criture\u2026) \xe0 des formes plus graves avec convulsions voire \xe9tat comateux.\n\n    -\tEnvisager des m\xe9dicaments anti\xe9pileptiques non s\xe9datifs (par ex. le l\xe9v\xe9tirac\xe9tam) pour la pr\xe9vention de crises convulsives. \n\n    -\tEnvisager une consultation en neurologie et avec d\u2019autres sp\xe9cialistes pour une \xe9valuation plus approfondie, si n\xe9cessaire. \n\nAfin de d\xe9tecter rapidement toute modification une \xe9valuation avec Echelle d\u2019\xe9valuation neurologique ICE est n\xe9cessaire x2/jour , a d\xe9buter le jour de l\u2019administration du teclistamab, avant pr\xe9m\xe9dication.\n\n",null,null,null,null,null,null,null,null,null)
