B.bcZ=new A.a("Dogme = \nToute recherche d\u2019IST justifie un d\xe9pistage global : s\xe9rologies VIH, VHB, syphilis, (VHC) => m\xeame mode de transmission (24% ! de co-infections IST VIH dans certains groupe) \n\nPrincipe de d\xe9pistage = \nSi \xe9coulement pr\xe9l\xe8vement pour culture et donc antibiogramme \xe0 r\xe9aliser mais pr\xe9l\xe8vement au m\xe9at => pas de frottis ou pr\xe9l\xe8vement ur\xe9tral ! \nPrivil\xe9gier les auto pr\xe9l\xe8vements (vagin, rectum) \n\n1er jet urinaire = \nne pas avoir urin\xe9 2h avant le test \n\nTraitement = par doxycycline = \xe0 prendre en mangeant, photosensibilisation possible, ne pas s\u2019allonger pendant 1h apr\xe8s la prise (\u0153sophagite) \n\nOrientation = toujours contr\xf4ler un test positif apr\xe8s traitement, orienter patient(e) vers CeGIDD au d\xe9cours surtout si <25ans , pr\xe9carit\xe9, multipartenaires \n \nAbbr\xe9viation\nNG Neisseria gonorrhoeae\nCT Chlamydia trachomatis\n\n",null,null,null,null,null,null,null,null,null)
