B.ez=new A.a("2.\tContexte et Objectifs",null,B.M,null,null,null,null,null,null,null)
B.b1X=new A.a("Cette proc\xe9dure a deux objectifs \n-\t De comprendre l\u2019importance de l\u2019utilisation de in-exsufflateur m\xe9canique ( le CoughAssist) sur les d\xe9sencombrements des voies respiratoires parmi  les sujets en r\xe9animation. \n-\t De savoir et  pouvoir l\u2019utiliser. \n",null,null,null,null,null,null,null,null,null)
B.fQ=new A.a("3.\tD\xe9finitions, Abr\xe9viations ",null,B.M,null,null,null,null,null,null,null)
B.b6f=new A.a("C\u2019est un appareil utilisant un syst\xe8me m\xe9canique d\u2019insufflation et d\u2019exsufflation. Il est utilis\xe9 pour les patients ayant une toux inefficace.\n Le but est d\u2019\xe9viter l\u2019encombrement bronchique et d\u2019am\xe9liorer la respiration en \xe9liminant les s\xe9cr\xe9tions. L\u2019appareil d\xe9livre une inspiration profonde puis une exsufflation rapide, grace a des pressions positives les param\xe8tres varient en fonction du patient et du stade de la pathologie.\n(ATTENTION ;  Il ne faut pas faire plus de 5 cycles (insufflation et exsufflation cons\xe9cutive), faire un temps de repos avant de recommencer une s\xe9ance de travail).\nEn conclusion : Le cought Assist est tres efficace pour evacuer les s\xe9cretions, limiter les emcombrements et de pouvoir eviter les r\xe9-intubations, voir les arr\xeats cardiaque sur hypoxie.Mais aussi de  r\xe9duire le rique d\u2019infection des voies respiratoires, et ainsi de racourcir le temps d\u2019hospitalisation en service de reanimation/ ou soin intensif. \n",null,null,null,null,null,null,null,null,null)
B.ld=new A.a("4.\tD\xe9veloppement de la proc\xe9dure",null,B.M,null,null,null,null,null,null,null)
B.aM=new A.t(!0,B.bH,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.L5=new A.a("\t\t1)\tIndications",null,B.aM,null,null,null,null,null,null,null)
B.bfy=new A.a("Les patients ayant une toux inefficace.\n",null,null,null,null,null,null,null,null,null)
B.Lw=new A.a("\t\t2)\tContre-indications",null,B.aM,null,null,null,null,null,null,null)
B.b_M=new A.a("Contre indication d\u2019utilisation chez le patient en service de Reanimation et de soins intensifs. \n-\tRefus du patient ou trouble cognitif  \n-\tHemoptysie r\xe9cente \n-\tDetresse respiratoire severe \n-\tH\xe9mothorax/pneumothorax recent datant de moins de 3 mois \n-\tDrain thoracique de moins de 3 mois \n-\tInstabilit\xe9 cardiaque \n-\tPression intracranienne \n-\tNauss\xe9e \n-\tGrossesse ( possible mais a utilis\xe9 avec prudence ) \n\n",null,null,null,null,null,null,null,null,null)
B.bco=new A.a("\t\t3)\t\u2022\tReglage des parametres deux modes possibles Auto et Manuel",null,B.aM,null,null,null,null,null,null,null)
