B.b2O=new A.a("1. Raccordez l\u2019interface patient appropri\xe9e \xe0 l\u2019appareil. \n2. Appuyez sur le bouton d\u2019alimentation pour allumer l\u2019appareil.\n3. V\xe9rifiez vos r\xe9glages avant de d\xe9marrer le traitement\n4. Raccordez l\u2019interface patient appropri\xe9e au patient.\n5. Appuyez sur le bouton Traitement pour d\xe9marrer le traitement.\n6. L\u2019appareil effectue automatiquement un cycle d\u2019Inspiration (pression positive) \xe0 Expiration (pression n\xe9gative) \xe0 Pause (pression atmosph\xe9rique), puis retourne \xe0 la pression positive\n7. Une fois que les cycles n\xe9cessaires sont termin\xe9s, d\xe9connectez le patient de l\u2019appareil et \xe9liminez les s\xe9cr\xe9tions \xe9ventuellement visibles dans la bouche, la gorge\n\n",null,null,null,null,null,null,null,null,null)
