B.bpA=new A.a("La trach\xe9otomie est r\xe9alis\xe9e pour r\xe9aliser une ouverture dans la trach\xe9e. Elle est couramment pratiqu\xe9e aux soins intensifs pour les patients n\xe9cessitant une assistance ventilatoire prolong\xe9e. \nIl existe de nombreuses techniques et kits different ; la trach\xe9ostomie percutan\xe9e par dilatation est la plus courante et utilise une technique de Seldinger modifi\xe9e sous guidage bronchoscopique. L'\xe9chographie peut \xeatre utilis\xe9 pour exclure la pr\xe9sence de vaisseaux sanguins pr\xe9-trach\xe9aux. \n",null,null,null,null,null,null,null,null,null)
B.bb2=new A.a("EQUIPEMENTS:",null,B.z,null,null,null,null,null,null,null)
B.bjK=new A.a("  - Vid\xe9o bronchoscope flexible (Fibroscope)\n  - Tube de trach\xe9otomie\n  - Scalpel\n  - Aiguille (d'introduction)\n  - Fil-guide en J\n  - Petit dilatateur trach\xe9al 14 Fr\n  - Dilatateur trach\xe9al progressif en un passage\n  - Introducteur/dilatateur de mise de trach\xe9otomie\n\n",null,null,null,null,null,null,null,null,null)
B.b3e=new A.a("INDICATIONS:",null,B.z,null,null,null,null,null,null,null)
B.bmt=new A.a("  - Sevrage prolong\xe9 et ventilation m\xe9canique >7 jours\n  - Faciliter le sevrage\n  - Diminuer la s\xe9dation \n  - Obstruction des VAS\n  - Protection et d\xe9gagement des voies a\xe9riennes\n",null,null,null,null,null,null,null,null,null)
B.b6p=new A.a("CONTRE INDICATIONS:",null,B.z,null,null,null,null,null,null,null)
B.buw=new A.a("  Relatives:\n  - Ob\xe9sit\xe9\n  - Cou court\n  - PEP & FiO2 \xe9lev\xe9s\n  - Antiplaquettaire/Anticoagulant\n  - Thrombocytop\xe9nie\n  - Coagulopathie l\xe9g\xe8re\n  - Chirurgie m\xe9diastinale et du cou\n  Absolus:\n  - Infection tissulaire au site d'insertion\n  - Manque d'exp\xe9rience de l'op\xe9rateur\n  - Instabilit\xe9 cervicale\n  - Coagulopathie non contr\xf4l\xe9e\n\n",null,null,null,null,null,null,null,null,null)
