B.b1e=new A.a("Rassembler l'\xe9quipe et attribuer les r\xf4les: IDE, Kin\xe9, fibroscopiste, operateur. L'op\xe9rateur se tient sur le c\xf4t\xe9 droit du patient.\n  - Temps mort : Consentement \xe9clair\xe9 obtenu. Discuter de la gestion des voies respiratoires et des mesures de secours. V\xe9rifier l'anticoagulation etleu traitement antiplaquettaire\n  - Inspection de l'anatomie et de la mobilit\xe9 du cou\n  - Equipements: bronchoscope, kit de tracheostomie \n  - Meds: S\xe9dation/analg\xe9sie/curare ad\xe9quat \n  - Ventilateur: R\xe9glez la FiO2 \xe0 1,0 et le mode de ventilation pour assurer un VT et une VM ad\xe9quats (par ex. VC)\n\n",null,null,null,null,null,null,null,null,null)
B.bcK=new A.a("Rassembler l'\xe9quipe et attribuer les r\xf4les: IDE, Kin\xe9, fibroscopiste, operateur. L'op\xe9rateur se tient sur le c\xf4t\xe9 droit du patient.\n  - Temps mort : Consentement \xe9clair\xe9 obtenu. Discuter de la gestion des voies respiratoires et des mesures de secours. V\xe9rifier l'anticoagulation etleu traitement antiplaquettaire\n  - Inspection de l'anatomie et de la mobilit\xe9 du cou\n  - Equipements: bronchoscope, kit de tracheostomie \n  - Meds: S\xe9dation/analg\xe9sie/curare ad\xe9quat \n  - Ventilateur: R\xe9glez la FiO2 \xe0 1,0 et le mode de ventilation pour assurer un VT et une VM ad\xe9quats (par ex. VC)\n",null,null,null,null,null,null,null,null,null)
B.bjX=new A.a("PROCEDURE:",null,B.z,null,null,null,null,null,null,null)
B.b9b=new A.a("  - Position: extension du cou avec un rouleau plac\xe9 entre les scapula\n  - St\xe9riliser et mettre les champs sur le cou ant\xe9rieur\n  - Rep\xe8res: Palpation, Bronchoscopie \xb1 ultrason identification des anneaux trach\xe9aux. 2\xe8me et 3\xe8me anneau trach\xe9al site d'insertion id\xe9al.\n  - Anesth\xe9sie Locale: Lidocaine avec our sans Adr\xe9naline dans le plan sous cutan\xe9e\n  - \xc9tapes : \n      - Faites une incision cutan\xe9e verticale de 2 cm, qui peut \xeatre faite apr\xe8s insertion du fil-guide si vous pr\xe9f\xe9rez.\n      - Avec le bronchoscope, identifiez les anneaux trach\xe9aux et le cartilage thyro\xefde. Retirez la sonde endotrach\xe9ale au-dessus du niveau du site d'insertion de l'aiguille. \n      - Ins\xe9rez l'aiguille sur la ligne m\xe9diane, \xe0 midi, en vision directe. Introduire le fil-guide en J. Utilisez le dilatateur 14 Fr sur le fil-guide..\n      - Dilatateur trach\xe9al en un passage sur le fil-guide, puis retirer.\n      - Le tube de trach\xe9otomie est ins\xe9r\xe9 avec l'introducteur sur le fil-guide.\n      - Confirmation bronchoscopique de la position du tube de trach\xe9otomie. Le tube de trach\xe9otomie est connect\xe9 au ventilateur.\n      - La trach\xe9otomie est fix\xe9e avec des sutures (facultatives) et des attaches de cou.\n\n",null,null,null,null,null,null,null,null,null)
B.bcm=new A.a("POST PROCEDURE:",null,B.z,null,null,null,null,null,null,null)
B.bmk=new A.a("  - Placez un panneau indiquant le type de trach\xe9otomie et la date de l'intervention\n  - Ne pas changer la canule ext\xe9rieure pendant au moins une semaine\n  - Surveillez la pression du ballonnet de trach. (cible : 20-25 mmHg)\n  - Commencez le sevrage de la s\xe9dation et de la ventilation.\n  - Soins de la peau, pansement de trach\xe9otomie, changement de canule interne (et retrait des sutures, le cas \xe9ch\xe9ant)\n  - Essais du nez de trach\xe9otomie et de la valve phonatoire, le cas \xe9ch\xe9ant\n  - \xc9valuation de la deglutition & \xe9ducation du patient/ famille\n\n",null,null,null,null,null,null,null,null,null)
B.bg9=new A.a("CONSEILS DE D\xc9PANNAGE :",null,B.z,null,null,null,null,null,null,null)
B.b0g=new A.a("  - Tr\xe8s fr\xe9quent:  la sonde endotrach\xe9ale est trop basse et l'insertion de l'aiguille n'est pas visualis\xe9e. Le retrait de la sonde d\u2019intubation est s\xfbr sous guidage bronchoscopique.\n  - Saignements mineurs pendant la proc\xe9dure: ils sont g\xe9n\xe9ralement arr\xeat\xe9s par tamponnement une fois la trach\xe9otomie ins\xe9r\xe9e.\n  - Impossibilit\xe9 de dilater: la plupart des r\xe9sistances proviennent d\u2019une petite incision cutan\xe9e ou du fascia.\n  - Conseil : utilisez le bronchoscope pour vous assurer que le fil-guide reste dans la trach\xe9e pendant toute la proc\xe9dure.\n\n",null,null,null,null,null,null,null,null,null)
