B.bjc=new A.a("Infection par le VIH ",null,B.M,null,null,null,null,null,null,null)
B.biA=new A.a("Proposition du d\xe9pistage \xe0 tous les patients +++ > s\xe9rologie VIH coupl\xe9e avec s\xe9rologies h\xe9patites, IST, bilan de sant\xe9 global pour limiter les opportunit\xe9s manqu\xe9es. \n\nNB\u202f: Tout patient doit b\xe9n\xe9ficier d'une s\xe9rologie VIH au moins une fois dans la vie, voire plus dans certains groupes \xe0 risque (partenaires multiples, patients originaires de zone d'end\xe9mie (Afrique sub saharienne et Cara\xefbes, Am\xe9rique du Sud dont Guyane, Asie), travailleur(se) du sexe, usagers de drogues injectables \n",null,null,null,null,null,null,null,null,null)
B.b2N=new A.a("NB\u202f: On propose d\u2019informer le patient qu\u2019un bilan global sera r\xe9alis\xe9 incluant une s\xe9rologie VIH. En l\u2019absence d\u2019opposition, cela vaudra consentement.\n",null,B.cI,null,null,null,null,null,null,null)
B.b1S=new A.a("En cas de s\xe9rologie VIH positive\u202f: ",null,B.z,null,null,null,null,null,null,null)
B.btV=new A.a("- S\u2019assurer que le Western Blot est disponible ou en cours (analyse obligatoirement r\xe9alis\xe9e par le biologiste en cas de s\xe9rologie- Elisa- positive)  \n- Pr\xe9venir l\u2019infectiologue au DECT (22)6421  \n- En cas d\u2019infection VIH confirm\xe9e ou fortement suspect\xe9e, r\xe9aliser le bilan initial VIH (cf infra) pour d\xe9finir le stade de la maladie (VIH ou stade SIDA), rechercher des co-infections virales ou bact\xe9riennes et infections opportunistes, pr\xe9parer la mise sous traitement  \n- Rassurer le / la patient(e) sur l\u2019existence de traitement efficace et d\u2019une prise en charge coordonn\xe9e \n",null,null,null,null,null,null,null,null,null)
B.b5f=new A.a("Bilan initial du VIH 1 (cf Crossway taper \xab\u202fSMIT\u202f\xbb > bilan initial VIH) ",null,B.z,null,null,null,null,null,null,null)
B.b99=new A.a("- S\xe9rologie VIH de confirmation  \n-NFS plaquettes \u2013 iono sanguin \u2013 cr\xe9atin\xe9mie \u2013 bilan h\xe9patique complet \u2013 prot\xe9inurie/cr\xe9atinurie \u2013 bilan glucidolipidique \u2013 calc\xe9mie phosphor\xe9mie \u2013 \n-Num\xe9ration lymphocytaire CD4/CD8 (urgent) \u2013 charge virale VIH \n-S\xe9rologies\u202f:  VHB, VHC, syphilis, VHA (anticorps totaux et pas IgM)  \n-S\xe9rologie CMV, s\xe9rologie toxoplasmose \n-Quantif\xe9ron \u2013 TB  \n-Avec infectiologue compl\xe9ter les demandes (feuilles sp\xe9cifiques disponibles au SMIT):  g\xe9notypage VIH \u2013 HLA B57 01  \n-PCR gonocoque chlamydiae\u202f: femme (auto-pr\xe9l\xe8vement vaginal) ; homme (1er jet urinaire\u202f; auto-pr\xe9l\xe8vement anal selon groupe \xe0 risque) \n",null,null,null,null,null,null,null,null,null)
B.btT=new A.a("Si les CD4 sont <100/mm3\u202f: URGENT compl\xe9ter le bilan ",null,B.z,null,null,null,null,null,null,null)
B.bkX=new A.a("- PCR CMV sang  \n- Antig\xe9n\xe9mie cryptococoque sang  \n- +/- Recherche de mycobact\xe9rie sang  \n",null,null,null,null,null,null,null,null,null)
B.bfH=new A.a("Moins fr\xe9quent\u202f:  infections VIH-2 > voir avec infectiologue, m\xeame bilan mais charge virale VIH2\n",null,B.cI,null,null,null,null,null,null,null)
B.bmi=new A.a("Si le patient est connu VIH+\xa0",null,B.z,null,null,null,null,null,null,null)
B.blg=new A.a("- Pr\xe9venir l\u2019infectiologue au DECT (22)6421 (le SMIT peut aider \xe0 r\xe9cup\xe9rer les informations m\xe9dicales du patient si suivi dans une autre structure) \n- V\xe9rifier avec le patient quel est son service de r\xe9f\xe9rence (GHEF ou autre \xe9tablissement) et r\xe9cup\xe9rer le dernier compte rendu, quel est le traitement pris habituellement et surtout si il a arr\xeat\xe9 celui-ci (voyage, perdu de vue, d\xe9ni etc)  \n- Si aucune information n\u2019est disponible sur le GHEF, r\xe9aliser rapidement le bilan initial (cf supra) et <100 CD4/mm3 surtout si patient alt\xe9r\xe9 ou f\xe9brile \n\nLes examens suivants seront orient\xe9s par la suite selon le bilan, la clinique, le niveau d\u2019immunod\xe9pression et l\u2019origine du patient \u2026 : scanner TAP sans et avec IV, scanner c\xe9r\xe9bral sans et avec IV, PL, recherche de mycobact\xe9rie (crachats, tubages, urines, ganglions etc)\nCeci sera \xe0 discuter avec l\u2019infectiologue (dect (22)6421)    \n",null,null,null,null,null,null,null,null,null)
