B.b7a=new A.a("Une infection est dite associ\xe9e aux soins (IAS) si elle survient au cours ou au d\xe9cours d\u2019une prise en charge diagnostique, th\xe9rapeutique, palliative, pr\xe9ventive ou \xe9ducative, et si elle n\u2019\xe9tait ni pr\xe9sente, ni en incubation au d\xe9but de la prise en charge.  \nOn parle d\u2019infection nosocomiale lorsque l\u2019IAS a \xe9t\xe9 contract\xe9e \xe0 l\u2019h\xf4pital. \nLe malade peut s\u2019infecter avec ses propres micro-organismes, \xe0 la faveur d\u2019un acte invasif et/ou en raison d\u2019une fragilit\xe9 particuli\xe8re. \nLes micro-organismes peuvent aussi avoir pour origine les autres malades (transmission crois\xe9e), les personnels ou la contamination de l\u2019environnement hospitalier \n",null,null,null,null,null,null,null,null,null)
B.bud=new A.a("Principales donn\xe9es actuelles ",null,B.z,null,null,null,null,null,null,null)
B.b24=new A.a("Les IAS concernent entre 5 et 6% des patients hospitalis\xe9s (ENP 2022) \nLes IAS les plus courantes sont : infections urinaires > pneumonies > infections du site op\xe9ratoire > bact\xe9ri\xe9mies. \nC\u2019est la troisi\xe8me cause d\u2019\xe9v\xe8nement ind\xe9sirable grave. \nIl est estim\xe9 que 20 \xe0 30% des IAS sont \xe9vitables. \n25 millions de cath\xe9ters veineux /an sont pos\xe9s aux patients en France. \nFaible taux de couverture des personnels de sant\xe9 pour les vaccins recommand\xe9s (grippe < 40%). \nLa pr\xe9valence des Ent\xe9robact\xe9ries r\xe9sistantes aux C3G est d\u2019environ 8% en \xe9tablissement de sant\xe9 VS 3% en ville  \n",null,null,null,null,null,null,null,null,null)
B.bg3=new A.a("Cons\xe9quences des infections nosocomiales\u202f:  ",null,B.z,null,null,null,null,null,null,null)
B.b4c=new A.a("Allongement des dur\xe9es d\u2019hospitalisation \nR\xe9interventions chirurgicales \n3000 \xe0 4000 d\xe9c\xe8s/an. \nLes risques augmentent avec l\u2019\xe2ge du patient, son terrain, et la nature des actes pratiqu\xe9s ; un patient porteur d\u2019un dispositif invasif a un risque d\u2019\xeatre infect\xe9 multipli\xe9 par 4 (ENP 2022). \nRisque de diffusion de la r\xe9sistance bact\xe9rienne au sein des \xe9tablissements \n",null,null,null,null,null,null,null,null,null)
B.bdl=new A.a("La lutte contre les IAS\u202f: ",null,B.z,null,null,null,null,null,null,null)
B.bnh=new A.a("Application des pr\xe9cautions standards et compl\xe9mentaires \nRespect des protocoles de soins (pr\xe9paration cutan\xe9e de l\u2019op\xe9r\xe9, antibioprophylaxie chirurgicale, r\xe9\xe9valuations des indications d\u2019un dispositif\u2026) \nVaccination du personnel \n",null,null,null,null,null,null,null,null,null)
