B.bdQ=new A.a("* 2 paires d\u2019h\xe9moculture (10 mL par flacon) \xe0 pr\xe9lever en une seule fois. \n* ECBC, apr\xe8s a\xe9rosol de s\xe9rum physiologique si n\xe9cessaire +/- aide de la kin\xe9sith\xe9rapeute. \n* L\u2019antig\xe9nurie pneumocoque n\u2019est pas recommand\xe9e en premi\xe8re intention sauf si le patient est hospitalis\xe9 en m\xe9decine intensive.\n* L\u2019antig\xe9nurie l\xe9gionelle n\u2019est recommand\xe9e que si le contexte ou la pr\xe9sentation clinique et biologique est \xe9vocatrice. En revanche, elle reste recommand\xe9e en cas d\u2019hospitalisation en m\xe9decine intensive.\n* En cas de suspicion de germe intracellulaire, prescrire une PCR Mycoplasma pneumoniae simple (pr\xe9l\xe8vement naso-pharyng\xe9e ou oro-pharyng\xe9e).\n*\tLa PCR multiplex ne doit \xeatre demand\xe9e qu\u2019en deuxi\xe8me intention et avec l\u2019accord du pneumologue d\u2019astreinte, de l\u2019infectiologue d\u2019astreinte ou du bact\xe9riologiste. Il s\u2019agit d\u2019un examen co\xfbteux.\n*\tLe dosage de la PCT n\u2019est PAS RECOMMANDE.\n\n",null,null,null,null,null,null,null,null,null)
