B.bgj=new A.a("Patients \xe0 risque \xe9lev\xe9 d\u2019IIP \n    \u2022 Patients immunod\xe9prim\xe9s (concern\xe9s par les recommandations de vaccination des immunod\xe9prim\xe9s et patients atteints de syndrome n\xe9phrotique) \n    \u2022 aspl\xe9niques ou hypospl\xe9niques (incluant les dr\xe9panocytoses majeures) \n    \u2022 atteints de d\xe9ficits immunitaires h\xe9r\xe9ditaires \n    \u2022 infect\xe9s par le VIH, quel que soit le statut immunologique \n    \u2022 sous chimioth\xe9rapie pour tumeur solide ou h\xe9mopathie maligne \n    \u2022 transplant\xe9s ou en attente de transplantation d\u2019organe solide \n    \u2022 greff\xe9s de cellules souches h\xe9matopo\xef\xe9tiques \n    \u2022 trait\xe9s par immunosuppresseur, bioth\xe9rapie et/ou corticoth\xe9rapie pour une maladie auto-immune ou inflammatoire chronique \n    \u2022 atteints de syndrome n\xe9phrotique \n\u2022 Patients non immunod\xe9prim\xe9s porteurs d\u2019une maladie sous-jacente pr\xe9disposant \xe0 la survenue d\u2019IIP \n    \u2022 cardiopathie cong\xe9nitale cyanog\xe8ne, insuffisance cardiaque \n    \u2022 insuffisance respiratoire chronique, bronchopneumopathie obstructive, emphys\xe8me \n    \u2022 asthme s\xe9v\xe8re sous traitement continu \n    \u2022 insuffisance r\xe9nale \n    \u2022 h\xe9patopathie chronique d\u2019origine alcoolique ou non \n    \u2022 diab\xe8te non \xe9quilibr\xe9 par le simple r\xe9gime; \n    \u2022 patients pr\xe9sentant une br\xe8che ost\xe9o-m\xe9ning\xe9e, un implant cochl\xe9aire ou candidats \xe0 une implantation cochl\xe9aire. \n\nSch\xe9ma de vaccination : \nPREVENAR 13 : 1 injection par voie IM \nSuivi 8 semaines plus tard de PNEUMOVAX 1 injection par voie IM\n",null,null,null,null,null,null,null,null,null)
