B.a9B=new A.w("Double D\xe9clenchement","assets/images/pathologies/respiratoire/asynchronie/6doubledeclenchement.png",null)
B.bjg=new A.a("Parfois aucun temps expiratoire entre les 2 cycles. Plus souvent en VAC que en VSAI\nM\xe9canisme: Demande ventilatoire \xe9lev\xe9 (petit VT et Ti court)\nTraiter:\n-Augmenter Ti, Tplateau (pas plus de 300ms sinon mal tol\xe9r\xe9) d\xe9bit d\xe9c\xe9l\xe9rant \n-Augmenter VT mais risque de dommage par Ventilation m\xe9canique (passer de 6 \xe0 8ml/kg) \n-Passer en VSAI\n- Ou Approfondir la s\xe9dation pour diminuer la commande respiratoire\n- En VAC : Augmenter le TI en diminuant le D\xe9bit ( determinant majeur du confort respiratoire et si <60l/min peut entrainer une nette augmentation du travail respi)\nContexte: Se voit en SDRA car on r\xe8gle petit volume\nDescription: \nDouble d\xe9clenchement 2 insufflation sans expiration asynchronie la plus fr\xe9quente \xe7a entra\xeene double volume\nSi on souhaite rester en vac: diminuer le d\xe9bit ne pas faire car plus du tout d'assistance ne pas faire non plus augmenter le temps de plateau \nLa vrai solution est de passer en vsai ou Si patient pas pr\xeat resedater ou curariser\n\n",null,null,null,null,null,null,null,null,null)
