B.b8_=new A.a("Ti trop court et demande inspiratoire importante\nSi s\u2019aggrave entraine un double d\xe9clenchement\nStrat\xe9gie th\xe9rapeutique est la meme que pour eviter le double d\xe9clenchement :\n-\tAugmenter le VT en maintenant un volume protectrice\n-\tAugmenter le Ti en diminuant le d\xe9bit mais eviter d\xe9bit <60l/min\n-\tAjouter une pause t\xe9l\xe9inspiratoire max 300ms\n-\tPasser en VSAI si en VAC\n-\tAugmenter s\xe9dation pour diminuer commande respiratoire du patient\n",null,null,null,null,null,null,null,null,null)
