B.bs0=new A.a("1.\tPoints importants \xe0 retenir sur l\u2019antibioth\xe9rapie (ATB)",null,B.M,null,null,null,null,null,null,null)
B.bq3=new A.a("\u2022\tAvant toute antibioth\xe9rapie, se poser la question de sa justification : toute fi\xe8vre n\u2019est pas une infection d\u2019origine bact\xe9rienne, une augmentation du taux de CRP n\u2019est pas synonyme de pathologies infectieuses, une BU positive ne signifie pas une infection urinaire\u2026\n\n\u2022\tNe pas traiter par ATB une fi\xe8vre sans point d\u2019appel chez un patient stable non immunod\xe9prim\xe9 : faire le bilan \xe9tiologique (3 paires d\u2019h\xe9mocultures en 1 fois (60 ml), un ECBU, une radiographie pulmonaire, des PCR virales en fonction de l\u2019\xe9pid\xe9miologie\u2026) et r\xe9\xe9valuer.\n\n\u2022\tEffectuer des pr\xe9l\xe8vements bact\xe9riologiques de bonne qualit\xe9 avant toute antibioth\xe9rapie.\n\n\u2022\tNe pas instituer de bith\xe9rapie en dehors des indications recommand\xe9es dans ce livret.\n\n\u2022\tInterroger le malade sur ses ant\xe9c\xe9dents allergiques aux antibiotiques. Si besoin, demander un avis sp\xe9cialis\xe9. \n\n\u2022\tAdapter la posologie au poids du patient : https://abxbmi.com/\n\n\u2022\tAdapter \xe0 la fonction r\xe9nale : http://sitegpr.com/fr/rein/recherche-par-medicaments/ \n\n\u2022\tRemplir l\u2019ordonnance nominative pour les antibiotiques de r\xe9serve.\n\n\u2022\tToujours r\xe9\xe9valuer l\u2019antibioth\xe9rapie \xe0 48 - 72 heures. Cette r\xe9\xe9valuation doit \xeatre trac\xe9e dans le dossier (obligation l\xe9gale) :\n    >\tUtilit\xe9 ?\n    >\tEfficacit\xe9 ? : adapt\xe9e aux r\xe9sultats microbiologiques (antibiogramme, \u2026) ; posologie suffisante (dosage, diffusion au site infect\xe9, \u2026)\n    >\tD\xe9sescalade ? \n\n\u2022\tDoser syst\xe9matiquement les aminosides et la vancomycine (efficacit\xe9, toxicit\xe9), et en fonction de la clinique et de l\u2019\xe9tiologie pour les autres antibiotiques.\n\n\u2022\tFaire un relais rapide par voie orale (si r\xe9ellement \xe9quivalente) d\xe8s que l\u2019\xe9volution est favorable.\n",null,null,null,null,null,null,null,null,null)
B.b30=new A.a("2.\tPrincipales recommandations des traitements antibiotiques",null,B.M,null,null,null,null,null,null,null)
B.cy=new A.t(!0,null,null,null,null,null,null,B.bh,null,null,null,null,null,null,null,null,null,B.fL,null,null,null,null,null,null,null,null)
B.bo8=new A.a("AMINOSIDES :",null,B.cy,null,null,null,null,null,null,null)
B.b6g=new A.a("\u2022\tPas d\u2019utilisation d\u2019aminoside en monoth\xe9rapie.\n\u2022\tUne dose/24 h.\n\u2022\tPour les infections communautaires => gentamicine \n\u2022\tPour les infections nosocomiales : \n      => si Cocci \xe0 G+   => gentamicine \n      => si Bacille \xe0 G- => amikacine.\n\u2022\tDiscuter l\u2019int\xe9r\xeat de la prolongation du traitement apr\xe8s 48 heures.\n\u2022\tTraitement court sauf exception avec recommandations de l\u2019\xe9quipe du SMIT ou bact\xe9riologistes.\n\u2022\tGentamicine : 6 mg/kg/j ; amikacine 20-30 mg/kg/j\n\u2022\tR\xe9siduelle syst\xe9matique en cas de r\xe9injection \xe0 48h \n",null,null,null,null,null,null,null,null,null)
B.b2X=new A.a("QUINOLONES en association sur Staphylococcus aureus :",null,B.cy,null,null,null,null,null,null,null)
B.bpD=new A.a("\u2022\tTenir compte de la biodisponibilit\xe9 si choix de la voie orale (sels de fer, topiques gastro-intestinaux Laitages diminuent l\u2019absorption). Privil\xe9gier la prise \xe0 jeun.\n\u2022\tEviter les fluoroquinolones quand la bact\xe9rie en cause est r\xe9sistante \xe0 l\u2019acide nalidixique (risque de r\xe9sistance). R\xe9server la ciprofloxacine aux infections \xe0 Pseudomonas aeruginosa.\n\u2022\tEviter l\u2019utilisation empirique d\u2019une fluoroquinolone dans les 3 \xe0 6 mois qui suivent l\u2019utilisation d\u2019une fluoroquinolone (risque de r\xe9sistance).\n",null,null,null,null,null,null,null,null,null)
B.bbp=new A.a("GLYCOPEPTIDES :",null,B.cy,null,null,null,null,null,null,null)
B.bv6=new A.a("\u2022\tNe pas utiliser de glycopeptides et de lin\xe9zolide pour le traitement des infections \xe0 staphylocoques sensibles \xe0 la m\xe9ticilline (m\xe9ti-S).\n\u2022\tPour la vancomycine, utiliser de pr\xe9f\xe9rence la perfusion continue et d\xe9buter par une dose de charge 30 mg/kg sur 2 h. Sinon, pas de perfusion d\u2019une dur\xe9e inf\xe9rieure \xe0 une heure.\n\u2022\tDoser syst\xe9matiquement le r\xe9siduel (efficacit\xe9) ou le plateau. Adapter en fonction de la clinique et de la fonction r\xe9nale*.\n",null,null,null,null,null,null,null,null,null)
B.b67=new A.a("\xdf-LACTAMINES :",null,B.cy,null,null,null,null,null,null,null)
B.bg6=new A.a("\u2022\tPas d\u2019amoxicillline + acide clavulanique dans le traitement des infections \xe0 :\n-\tPseudomonas aeruginosa\n-\tEnterobacter\n-\tSerratia \n-\tCitrobacter freundii\n-\tAcinetobacter baumannii\n\u2022\tPas de c\xe9phalosporine pour le traitement des infections \xe0 ent\xe9rocoque ou \xe0 Listeria (r\xe9sistance naturelle).\n\u2022\tPrivil\xe9gier les perfusions continues dans les sepsis graves.\n\nPAS D\u2019UTILISATION EN MONOTHERAPIE (risque de r\xe9sistance) POUR : Fluoroquinolones (pour les infections \xe0 staphylocoque et pyocyanique) - Acide Fusidique - Fosfomycine \u2013 Rifampicine.\n",null,null,null,null,null,null,null,null,null)
B.boJ=new A.a("MUPIROCINE :",null,B.cy,null,null,null,null,null,null,null)
B.bii=new A.a("\u2022\tPas de d\xe9contamination nasale des patients porteurs de SARM, en cas de plaie chronique ou de dispositif invasif (sonde urinaire, \u2026).\n",null,null,null,null,null,null,null,null,null)
B.bkm=new A.a("RIFAMPICINE :  ",null,B.cy,null,null,null,null,null,null,null)
B.bp3=new A.a("\u2022\tToujours en association et \xe0 prendre \xe0 jeun. V\xe9rifier syst\xe9matiquement les int\xe9ractions.\n",null,null,null,null,null,null,null,null,null)
B.b0E=new A.a("EN GENERAL :",null,B.cy,null,null,null,null,null,null,null)
B.b9Y=new A.a("\u2022\tPas d\u2019indication \xe0 une antibioth\xe9rapie par voie locale ou g\xe9n\xe9rale pour des plaies colonis\xe9es ou infect\xe9es.\n\u2022\tPas d\u2019indication \xe0 prolonger l\u2019antibioth\xe9rapie au-del\xe0 de 7 jours le plus souvent. Un traitement prolong\xe9 doit \xeatre discut\xe9 avec les sp\xe9cialistes (SMIT 22-6421, bact\xe9riologistes).\n\u2022\tPas d\u2019antibioth\xe9rapie si bact\xe9riurie asymptomatique (sauf chez la femme enceinte et avant une proc\xe9dure urologique).\n",null,null,null,null,null,null,null,null,null)
B.b48=new A.a("3.\tConcentrations s\xe9riques attendues des principaux antibiotiques (dosage)",null,B.M,null,null,null,null,null,null,null)
B.bgA=new A.a("Aminosides :",null,B.cy,null,null,null,null,null,null,null)
B.bfl=new A.a("Dans la grande majorit\xe9, une seule injection suffit.\nL\u2019utilisation des aminosides doit \xeatre limit\xe9e au choc septique, en probabiliste lors d\u2019un risque important d\u2019infection \xe0 BLSE, devant certaines endocardites.\nIl est obligatoire de v\xe9rifier le r\xe9siduel avant chaque r\xe9-injection :\n\tGentamicine : < 0,5 mg/l\n\tAmikacine : < 2,5 mg/L\n\n",null,null,null,null,null,null,null,null,null)
B.bnP=new A.a("Glycopeptides= vancomycine",null,B.cy,null,null,null,null,null,null,null)
B.bfa=new A.a("Dosage r\xe9alis\xe9 sur les 3 sites du GHEF, 7j/7\nPour les staphylocoques, la mesure des CMI par le laboratoire est indispensable pour le suivi th\xe9rapeutique : il est recommand\xe9 de changer de classe th\xe9rapeutique si CMI > 2 mg/L.\nSeul le r\xe9siduel ou le taux continu sont utiles pour le suivi th\xe9rapeutique \uf0e8 antibiotiques temps-d\xe9pendants\nR\xe9siduel : 20 \u2013 30 mg/l : infections s\xe9v\xe8res, endocardite\n                  30 \u2013 40 mg/l si infection ost\xe9o-articulaire, m\xe9ningite\nContinu : 15 \u2013 20 mg/l\nLa vancomycine \xe9tant veinotoxique, la voie veineuse doit \xeatre de bon calibre.\nLa vancomycine est de plus en plus remplac\xe9e par la daptomycine CUBICIN en raison de sa simplicit\xe9 d\u2019utilisation.\n",null,null,null,null,null,null,null,null,null)
B.b6k=new A.a("B\xe9talactamines",null,B.cy,null,null,null,null,null,null,null)
B.bek=new A.a("R\xe9alis\xe9 par HPLC sur le site de Meaux, du lundi au vendredi : r\xe9sultat au mieux \xe0 J0 si le tube est achemin\xe9 avant 12h30 sur ce site.\nMol\xe9cules dos\xe9es : amoxicilline, cloxacilline, piperacilline, cefotaxime, ceftriaxone, ceftazidime, imip\xe9n\xe8me, ertap\xe9n\xe8me, merop\xe9n\xe8me (les autres mol\xe9cules sont externalis\xe9es).\nIndications : infections s\xe9v\xe8res, h\xe9modynamique perturb\xe9e (r\xe9animation, h\xe9matologie, polytraumatis\xe9s, etc.), BMR (la mesure de la CMI par le laboratoire est indispensable pour l\u2019interpr\xe9tation des dosages).\nSeul le r\xe9siduel (perfusion courte) ou le taux continu (perfusion continue) sont utiles pour le suivi th\xe9rapeutique => antibiotiques temps-d\xe9pendants (objectif 8-10 x CMI : rendus avec les dosages).\n",null,null,null,null,null,null,null,null,null)
B.b0B=new A.a("Fluoroquinolones",null,B.cy,null,null,null,null,null,null,null)
B.bhx=new A.a("Dosage r\xe9alis\xe9 sur le site de Meaux, du lundi au vendredi. Mol\xe9cules dos\xe9es : ofloxacine, levofloxacine, ciprofloxacine.\nPr\xe9lever r\xe9siduel (avant la prise) et pic (2h apr\xe8s la prise)  => antibiotiques dose-d\xe9pendants. L\u2019ASC (quantit\xe9 totale d\u2019antibiotiques) est pr\xe9dictive de l\u2019efficacit\xe9.\nIndications : infections osseuses, \xe0 discuter dans les infections s\xe9v\xe8res.\n",null,null,null,null,null,null,null,null,null)
B.bsa=new A.a("Rifampicine : ",null,B.cy,null,null,null,null,null,null,null)
B.bqj=new A.a("Dosage r\xe9alis\xe9 sur le site de Meaux, du lundi au vendredi. Indications : surtout infections osseuses. \nPr\xe9lever r\xe9siduel (avant la prise) et pic (2h apr\xe8s la prise)  \n",null,null,null,null,null,null,null,null,null)
