B.aTl=new A.ab("- Sevrage ventilatoire prolong\xe9 . \n- Pathologie neuromusculaire acquise et potentiellement r\xe9versible .\n- Patients BPCO ( concertation pluridisciplinaire ) . \n\n  \n\n",null,null,B.y,null)
B.aTo=new A.ab("III. Int\xe9r\xeat\n",null,null,B.y,B.z)
B.aTb=new A.ab("- Am\xe9lioration du confort de patient \n- Facilitation des soins ORL \n- Sevrage ventilatoire progressif (alternance ventilation spontan\xe9e et VSAI)\n- Aspiration bronchique \n- D\xe9canulation progressive\n- Gestion des troubles de d\xe9glutition, phonation et olfaction. \n- Facilit\xe9e de la mobilisation  et la r\xe9education du patient. \n\n\n",null,null,B.y,null)
B.aU0=new A.ab("IV. Modalit\xe9s de la trach\xe9otomie\n",null,null,B.y,B.z)
B.aTM=new A.ab("\nD\xe9lai:\n  -Pr\xe9coce / tardif \n  -Pas avant le 4\xe8me jour d'une ventilation invasive \n\nTypes:\n- Percutan\xe9e:  r\xe9animateur ,  l\xe9sion de cartilage , granulome . \n- Chirurgicale :  chirurgien ORL , risque de saignement  de l orifice . \n  Indication de la voie chirurgicale:\n    -Ob\xe9sit\xe9 \n    -Cou court \n    -Hypertrophie thyro\xefdienne \n    -Raideur rachidienne \n    -Cou remani\xe9 \n\n- Contre indication de la trach\xe9otomie:\n  -Instabilit\xe9 h\xe9modynamique \n  -HTIC \n  -Hypox\xe9mie s\xe9v\xe8re Pao2/Fio2 <100 \n  -Trouble de l'h\xe9mostase \n  -Refus du patient / famille \n  -LATA \n\n\n\n",null,null,B.y,null)
B.aTp=new A.ab("V. Complications\n",null,null,B.y,B.z)
B.aSW=new A.ab("-Pr\xe9coces:\n  -Saignement \n  -Infection \n  -L\xe9sions paroi trach\xe9ale post\xe9rieur \n  -Emphys\xe8me sous cutan\xe9, pneumothorax \n  -Obstruction de la canule \n  -Trajet anormal, difficult\xe9s de repositionnement \n-Tardives:\n  -St\xe9nose trach\xe9ale \n  -Trach\xe9omalacie \n  -Fistule avec vaisseau \n  -Fistule oeso trach\xe9ale\n\n\n",null,null,B.y,null)
