B.bpj=new A.a("Services concern\xe9es: R\xe9animation\nPersonnes concern\xe9es: R\xe9animateurs, Interne, IDE et AS\n",null,null,null,null,null,null,null,null,null)
B.b4G=new A.a("Afin d\u2019am\xe9liorer les pratiques professionnelles et de promouvoir la gestion des risques associ\xe9s aux soins, nous avons r\xe9dig\xe9 une proc\xe9dure sur la trach\xe9otomie en service de r\xe9animation et USC. Cette proc\xe9dure a pour objectif d\u2019harmoniser les pratiques des soignants concernant la r\xe9alisation de la trach\xe9otomie, assurer les soins au quotidien du patient trach\xe9otomis\xe9, le sevrage ventilatoire et la d\xe9canulation.",null,null,null,null,null,null,null,null,null)
B.buc=new A.a("3.\tAbr\xe9viations ",null,B.M,null,null,null,null,null,null,null)
B.bjU=new A.a("IDE : Infirmier dipl\xf4m\xe9 d\u2019\xe9tat\nLATA : Limitation et arr\xeat des th\xe9rapeutiques actives\nNez artificiel : appel\xe9 aussi \xe9changeur de chaleur et d\u2019humidit\xe9, est n\xe9cessaire \xe0 la protection des voies a\xe9riennes, \xe0 l\u2019humidification et au r\xe9chauffement de l\u2019air. Il est \xe0 changer une fois par jour minimum (ou plus s\u2019il est souill\xe9).\nSRLF : Soci\xe9t\xe9 de R\xe9animation de Langue Fran\xe7aise\nSFAR : Soci\xe9t\xe9 fran\xe7aise d\u2019anesth\xe9sie et de r\xe9animation\nSIOT : sonde d\u2019intubation oro-trach\xe9ale\nSHA : Solution hydro alcoolique\nValve phonatoire : valve unidirectionnelle qui s\u2019ouvre lorsque le patient inspire et se ferme lorsque le patient expire. Elle permet au patient d\u2019\xe9mettre des sons et am\xe9liore son d\xe9bit inspiratoire.\nVNI : Ventilation non invasive\nVSAI : Ventilation spontan\xe9e avec aide inspiratoire\nVS Trach : Ventilation spontan\xe9e chez un patient trach\xe9otomis\xe9 et d\xe9ventil\xe9\n",null,null,null,null,null,null,null,null,null)
B.b8r=new A.a("4.\tD\xe9finition ",null,B.M,null,null,null,null,null,null,null)
B.bn8=new A.a("La trach\xe9otomie est une ouverture chirurgicale dans la trach\xe9e r\xe9alis\xe9e \xe0 l\u2019aide d\u2019une canule pour assurer une perm\xe9abilit\xe9 permanente des voies a\xe9riennes. \nElle ne se r\xe9alise pas avant le 4\xe8me jour de ventilation invasive selon les recommandations de la SRLF et de la SFAR. \nElle est indiqu\xe9e pour un sevrage ventilatoire chez des patients n\xe9cessitant une ventilation m\xe9canique prolong\xe9e due \xe0 une insuffisance respiratoire ou une pathologie neuromusculaire.\nLa trach\xe9otomie est diff\xe9rente de la trach\xe9ostomie. La trach\xe9ostomie est un abouchement chirurgical de la trach\xe9e \xe0 la peau apr\xe8s une laryngectomie.\n",null,null,null,null,null,null,null,null,null)
B.aaM=new A.w("Tracheotomie","assets/images/pathologies/respiratoire/prototrach/Tracheotomie.jpg",null)
B.S8=new A.L(B.m,null,null,B.aaM,null)
B.abi=new A.w("Tracheostomie","assets/images/pathologies/respiratoire/prototrach/Tracheostomie.png",null)
B.RL=new A.L(B.m,null,null,B.abi,null)
B.bnm=new A.a("Il existe 2 types de trach\xe9otomie :\n\u2022\tPercutan\xe9e : r\xe9alis\xe9e par le r\xe9animateur avec un fibroscope au lit du malade, sous anesth\xe9sie locale ou g\xe9n\xe9rale.\n\u2022\tChirurgicale : r\xe9alis\xe9e au bloc op\xe9ratoire par un chirurgien ORL sous anesth\xe9sie g\xe9n\xe9rale, chez des patients pr\xe9sentant des comorbidit\xe9s rendant difficile la trach\xe9otomie.\n\nInt\xe9r\xeats de la trach\xe9otomie :\n\u2022\tMaintenir la libert\xe9 des voies respiratoires en facilitant un sevrage ventilatoire progressif.\n\u2022\tPermettre de d\xe9tecter des troubles de la d\xe9glutition\n\u2022\tFaciliter la parole.\n\u2022\tPermettre au patient de se r\xe9\xe9duquer au niveau respiratoire et d\u2019acqu\xe9rir une autonomie progressive de sa fonction respiratoire.\n\u2022\tAm\xe9liorer le confort du patient et faciliter sa mobilisation\n",null,null,null,null,null,null,null,null,null)
B.b8v=new A.a("5.\tContre-indication de la trach\xe9otomie",null,B.M,null,null,null,null,null,null,null)
B.bqA=new A.a("\u2022\tInstabilit\xe9 h\xe9modynamique\n\u2022\tHypertension intracr\xe2nienne \n\u2022\tHypox\xe9mie s\xe9v\xe8re\n\u2022\tTrouble de l\u2019h\xe9mostase \n\u2022\tRefus du patient ou de sa famille \n\u2022\tLATA \n",null,null,null,null,null,null,null,null,null)
B.b5q=new A.a("6.\tComplications de la trach\xe9otomie",null,B.M,null,null,null,null,null,null,null)
B.bsp=new A.a("\t\t1)\tPr\xe9coces",null,B.aM,null,null,null,null,null,null,null)
B.b6t=new A.a("\u2022\tSaignement \n\u2022\tInfection \n\u2022\tL\xe9sions de la paroi trach\xe9ale post\xe9rieure \n\u2022\tEmphys\xe8me sous cutan\xe9 ou pneumothorax \n\u2022\tObstruction de la canule \n\u2022\tTrajet anormal : difficult\xe9s de repositionnement \n",null,null,null,null,null,null,null,null,null)
B.b5c=new A.a("\t\t2)\tTardives",null,B.aM,null,null,null,null,null,null,null)
B.boO=new A.a("\u2022\tSt\xe9nose trach\xe9ale \n\u2022\tTrach\xe9omalacie (r\xe9tr\xe9cissement des parois de la trach\xe9e entra\xeenant une r\xe9duction des voies a\xe9riennes)\n\u2022\tFistule oeso-trach\xe9ale\n\u2022\tGranulomes\n",null,null,null,null,null,null,null,null,null)
B.b0F=new A.a("7.\tR\xe9alisation de la trach\xe9otomie percutan\xe9e ",null,B.M,null,null,null,null,null,null,null)
B.b7Q=new A.a("\t\t1)\tMat\xe9riel",null,B.aM,null,null,null,null,null,null,null)
B.bbT=new A.a("\u2022\tUn kit de trach\xe9otomie percutan\xe9 de calibre ad\xe9quate (voir pour la taille avec le m\xe9decin : ch. 7, 8 ou 9)\n",null,null,null,null,null,null,null,null,null)
B.a9i=new A.w("Kit Trach\xe9otomie","assets/images/pathologies/respiratoire/prototrach/kit.png",null)
B.Ss=new A.L(B.m,null,null,B.a9i,null)
B.b6C=new A.a("\u2022\tUne canule de trach\xe9otomie fen\xeatr\xe9e \xe0 basse pression\n\u2022\tUn \xe9carteur de Laborde\n\u2022\tUn pansement de trach\xe9otomie (M\xe9talline\xae)\n\u2022\tUn cordon de fixation\n\u2022\tUn champ transparent fen\xeatr\xe9\n\u2022\tUn grand champ vert\n\u2022\tUne casaque st\xe9rile et une paire de gants st\xe9riles pour celui qui r\xe9alise le geste\n\u2022\tUne charlotte, un masque chirurgical et une surblouse pour toute personne pr\xe9sente dans la chambre\n\u2022\tUne seringue de 10 ml\n\u2022\tUn flacon de 500 ml d\u2019eau st\xe9rile\n\u2022\tUn flacon de 250 ml de NaCl \xe0 0,9%\n\u2022\tUn bistouri\n\u2022\tUn fil\n\u2022\tDes compresses st\xe9riles\n\u2022\tUn set d\u2019asepsie cutan\xe9\n\u2022\tUn syst\xe8me clos pour trach\xe9otomie\n\u2022\tUn billot\n\u2022\tLe mat\xe9riel et le chariot de fibroscopie (cf. proc\xe9dure)\n",null,null,null,null,null,null,null,null,null)
B.bqR=new A.a("\t\t2)\tD\xe9roulement du soin",null,B.aM,null,null,null,null,null,null,null)
B.blZ=new A.a("a.\tAvant",null,B.az,null,null,null,null,null,null,null)
B.b0U=new A.a("\u2022\tPr\xe9venir le patient et sa famille et leur demander leur accord.\n\u2022\tV\xe9rifier le bilan d\u2019h\xe9mostase du patient.\n\u2022\tS\u2019il y a un traitement anticoagulant, sur prescription m\xe9dicale le modifier ou l\u2019arr\xeater.\n\u2022\tLe patient doit \xeatre \xe0 jeun \xe0 minuit la veille du geste sur prescription m\xe9dicale.\n\u2022\tL\u2019IDE v\xe9rifie la perm\xe9abilit\xe9 des voies veineuses centrales ou p\xe9riph\xe9riques.\n\u2022\tL\u2019IDE s\u2019assure que le mat\xe9riel d\u2019intubation est op\xe9rationnel et que le syst\xe8me d\u2019aspiration est fonctionnel.\n\u2022\tUn soin de bouche doit \xeatre r\xe9alis\xe9 apr\xe8s une friction d\u2019une SHA.\n",null,null,null,null,null,null,null,null,null)
B.bjB=new A.a("b.\tPendant",null,B.az,null,null,null,null,null,null,null)
B.bdS=new A.a("\u2022\tPr\xe9sence de deux m\xe9decins : un pour r\xe9aliser la trach\xe9otomie percutan\xe9e et le deuxi\xe8me pour g\xe9rer le fibroscope, la sonde d\u2019intubation et la ventilation.\n\u2022\tMettre une charlotte, un masque chirurgical et une surblouse. \n\u2022\tSur prescription m\xe9dicale, le patient doit \xeatre s\xe9dat\xe9 et curaris\xe9 afin d\u2019\xe9viter tous mouvements.\n\u2022\tLe patient est mis en d\xe9cubitus dorsal avec la nuque en hyperextension en pla\xe7ant un billot sous les \xe9paules.\n\u2022\tR\xe9gler le respirateur en mode ventilation contr\xf4l\xe9e et \xe0 100% de Fio2 pour assurer une oxyg\xe9nation parfaite (augmentation des seuils des alarmes de pression et de volume).\n\u2022\tL\u2019IDE r\xe9alise une friction d\u2019une SHA et effectuer une d\xe9sinfection du site de ponction : nettoyage au savon doux en unidose st\xe9rile, puis rin\xe7age au NaCl 0,9%, essuyage aux compresses st\xe9riles puis antisepsie \xe0 la Chlorhexidine\xae alcoolique 2% type Bactiseptic\xae/Gilbert\xae color\xe9.\n\u2022\tL\u2019IDE installe la table de l\u2019op\xe9rateur, d\xe9contamin\xe9 au pr\xe9alable et donne le mat\xe9riel au m\xe9decin.\n\u2022\tLe m\xe9decin qui fait le geste r\xe9alise une friction d\u2019une SHA, met une casaque et des gants st\xe9riles et pr\xe9pare son mat\xe9riel sur le champ st\xe9rile : ouvre le kit percutan\xe9 et v\xe9rifie le ballonnet de la canule de trach\xe9otomie. Il appose un champ st\xe9rile fen\xeatr\xe9 sur l\u2019orifice de ponction et un deuxi\xe8me champ sur le patient. Il r\xe9alise une deuxi\xe8me d\xe9sinfection du site de ponction \xe0 la Chlorhexidine\xae alcoolique 2% type Bactiseptic\xae/Gilbert\xae color\xe9.\n\u2022\tLe deuxi\xe8me m\xe9decin se positionne \xe0 la t\xeate du patient avec le chariot de fibroscopie. Il tire la SIOT sous contr\xf4le fibroscopique en pla\xe7ant le ballonnet sous les cordes vocales permettant ainsi de ventiler le patient sans g\xeaner la ponction trach\xe9ale.\n\u2022\tLe rep\xe9rage du site de ponction est r\xe9alis\xe9 par palpation (entre le 2\xe8me et 3\xe8me anneau trach\xe9al ou \xe0 1 cm sous le cartilage crico\xefde) mais \xe9galement par transillumination avec le fibroscope.\n\u2022\tUne fois que le rep\xe9rage est fait, la ponction trach\xe9ale est faite \xe0 l\u2019aide de l\u2019aiguille mont\xe9e sur une seringue remplie de NaCl \xe0 0,9%. Un reflux d\u2019air dans la seringue montre le bon positionnement de l\u2019aiguille qui est \xe9galement confirm\xe9 par le fibroscope.\n\u2022\tAu travers de l\u2019aiguille, introduire le guide m\xe9tallique dans la trach\xe9e en direction de la car\xe8ne, puis retirer l\u2019aiguille. Puis, l\u2019orifice sera \xe9largi \xe0 l\u2019aide de plusieurs dilatateurs (en forme de corne de rhinoc\xe9ros).\n\u2022\tUne fois l\u2019orifice dilat\xe9, la canule de trach\xe9otomie est mise en place et fix\xe9 par un fils \xe0 la peau. \n\u2022\tMettre le fibroscope dans la canule de trach\xe9otomie pour v\xe9rifier le bon positionnement et l\u2019absence d\u2019h\xe9morragie importante.\n\u2022\tLa SIOT est retir\xe9e compl\xe8tement. Il faut mettre en place le syst\xe8me clos pour trach\xe9otomie et rebrancher le patient sur le respirateur.\n\u2022\tAu cours du soin : surveiller les param\xe8tres respiratoires et l\u2019\xe9tat clinique du patient. \n",null,null,null,null,null,null,null,null,null)
B.bu5=new A.a("c.\tApr\xe8s",null,B.az,null,null,null,null,null,null,null)
B.bso=new A.a("\u2022\tMettre en place le cordon et s\u2019assurer que la canule est bien fix\xe9e.\n\u2022\tV\xe9rifier la pression du ballonnet \xe0 l\u2019aide du manom\xe8tre.\n\u2022\tAspirer avec le fibroscope les s\xe9cr\xe9tions.\n\u2022\tR\xe9installer le patient.\n\u2022\tFaire une radiographie thoracique.\n\u2022\tTracer dans ICCA le geste et retranscrire les param\xe8tres du patient.\n\u2022\tD\xe8s que possible, remettre les param\xe8tres ventilatoires du patient avant le geste (mode ventilatoire, Fio2 et alarmes).\n\u2022\tSurveillance de l\u2019orifice de la trach\xe9otomie : signaler tout changement au m\xe9decin.\n\u2022\tSurveillance de l\u2019\xe9tat respiratoire du patient trach\xe9otomis\xe9 : saturation, fr\xe9quence respiratoire, type de respiration.\n",null,null,null,null,null,null,null,null,null)
B.bgK=new A.a("d.\tMat\xe9riel de s\xe9curit\xe9 pour patient trach\xe9otomis\xe9",null,B.az,null,null,null,null,null,null,null)
B.b8Z=new A.a("Dans la chambre du patient, il est n\xe9cessaire de mettre en place le mat\xe9riel de s\xe9curit\xe9 du patient et il doit \xeatre v\xe9rifier \xe0 chaque prise de poste.\n\u2022\tUn manom\xe8tre\n\u2022\tUn \xe9carteur de Laborde (pince 3 branches)\n\u2022\tUne 2\xe8me canule de rechange de m\xeame taille\n\u2022\tDes sondes d\u2019aspiration taille 12 ou 14\n\u2022\tUn cordon de fixation\n\u2022\tUn pansement de type M\xe9talline\xae\n\u2022\tUn goupillon pour nettoyer la chemise interne\n",null,null,null,null,null,null,null,null,null)
B.ac8=new A.w("\xe9carteur de Laborde","assets/images/pathologies/respiratoire/prototrach/laborde.png",null)
B.Qu=new A.L(B.m,null,null,B.ac8,null)
B.bkt=new A.a("8.\tLes soins du patient trach\xe9otomis\xe9",null,B.M,null,null,null,null,null,null,null)
B.boG=new A.a("\t\t1)\tPr\xe9requis",null,B.aM,null,null,null,null,null,null,null)
B.bcq=new A.a("\u2022\tR\xe9fection du pansement 2 fois par jour pendant 4 jours :\n    -au NaCl 0,9% pour la trach\xe9otomie percutan\xe9e\n    -avec un 4 temps \xe0 la B\xe9tadine\xae (ou scrub si allergie) pour la trach\xe9otomie chirurgicale.\n\u2022\tChangement du cordon de fixation une fois par jour (ou plus si mat\xe9riel souill\xe9).\n\u2022\tNettoyage de la chemise interne une fois par \xe9quipe (ou plus en fonction des s\xe9cr\xe9tions du patient). \n\u2022\tAblation des fils au bout de 3 jours.\n",null,null,null,null,null,null,null,null,null)
B.b6H=new A.a("\t\t2)\tR\xe9fection du pansement de trach\xe9otomie",null,B.aM,null,null,null,null,null,null,null)
B.bcY=new A.a("\u2022\tPr\xe9venir le patient du soin effectu\xe9.\n\u2022\tInstaller le patient en position demi assise\n\u2022\tPr\xe9voir son mat\xe9riel pour le soin : \n    -Un set de pansement st\xe9rile\n    -Selon le type de trach\xe9otomie r\xe9alis\xe9e une d\xe9sinfection \xe0 la gamme b\xe9tadine\xae (scrub et dermique) ou au NaCl 0,9% seulement\n    -Un pansement type M\xe9talline\xae\n    -Un cordon de fixation\n    -Une paire de gant\n    -Un masque chirurgical\n    -Une charlotte\n    -Une surblouse\n",null,null,null,null,null,null,null,null,null)
