B.beC=new A.a("M\xe9decin,IADE / IDE : participation au geste, soin en collaboration\nL\u2019article R.4311-7 du CSP ne mentionne aucunement les cath\xe9ters intra-osseux tout comme d\u2019ailleurs les autres articles du Code relatifs aux comp\xe9tences infirmi\xe8res.En pratique, dans ce contexte encadr\xe9 et au vu des donn\xe9es m\xe9dicales \xabrassurantes\xbb (simplicit\xe9 d\u2019utilisation, court apprentissage, rapidit\xe9 de mise en \u0153uvre, rares complications, utilisation de mol\xe9cules et solut\xe9s aux m\xeames posologies), la pose de cette voie d\u2019abord par les infirmiers (alternative \xe0 la voie veineuse p\xe9riph\xe9rique) pr\xe9sente un risque faible. Elle est possible dans ce contexte d\u2019urgences que si les param\xe9dicaux ont b\xe9n\xe9fici\xe9 d\u2019une formation valid\xe9e par les responsables m\xe9dicaux, et que les indications sont pos\xe9es dans le cadre d\u2019une proc\xe9dure de service parfaitement respect\xe9es. La formation des param\xe9dicaux doit \xeatre renouvel\xe9e chaque ann\xe9e \n",null,null,null,null,null,null,null,null,null)
