B.b1l=new A.a("Les infections qui ne justifient pas d\u2019un traitement en ATB\n    \u2022\tLa rhinopharyngite : atteinte inflammatoire du pharynx et des fosses nasales d\u2019origine virale associant : fi\xe8vre, toux, rhinorrh\xe9e m\xeame purulente (d\u2019\xe9volution spontan\xe9ment favorable en +/- 7 jours).\n    \u2022\tL\u2019otite congestive ou s\xe9romuqueuse : tympan rouge, transparent et non bomb\xe9.\n    \u2022\tLes sinusalgies : congestion des m\xe9ats sinusiens d\u2019origine virale et spontan\xe9ment r\xe9solutive. (contemporaines d\u2019une rhinopharyngite)\n\nLes infections pour lesquelles il est recommand\xe9 de prescrire 1 ATB sont :\nL\u2019OMA, la sinusite, l\u2019angine \xe0 streptocoque A.\n\nL\u2019amoxicilline est recommand\xe9e en premi\xe8re intention dans les infections respiratoires hautes.\n",null,null,null,null,null,null,null,null,null)
