B.aTn=new A.ab("Sensibilise myofilament aux Ca2+: Effet Inotrope +\nAgoniste des canaux K ATP d\xe9pendant: Effet Vasodilatateur\nAbsence de d\xe9monstration de diminution de mortalit\xe9 par rapport \xe0 la Dobutamine chez les insuffisant cardiaque\n\nEffets seondaires:\n  - Vasodilatation > Dobutamine\n  - Trouble du rythme = Dobutamine\n\n=> Pas en premi\xe8re intention:\n  - Patient beta bloqu\xe9 habituellement\n  - Takotsubo\n  - Attente d'une greffe cardiaque ou sous assistance ventriculaire\n  - Sevrage ECMO VA\n\nUsage: Zimino 2,5mg/ml (Tableau dans le Vidal)\nDose de charge 6-12\xb5g/kg en perfusion sur 10min puis IVSE 0,1\xb5g/kg/min\nR\xe9\xe9valuation \xe0 30-60min:\n  - R\xe9ponse excessive: Diminuer \xe0 0,05\xb5g/kg/min\n  - R\xe9ponse insuffisante: Augmenter \xe0 0,2\xb5g/kg/min\n  \n\n",null,null,B.y,null)
