B.bjI=new A.a("\xc9CHOGRAPHIE ABDOMINALE\n\xc9panchement p\xe9riton\xe9al liquidien (figure 21)\nPlusieurs \xe9tudes ont valid\xe9 l'excellente performance de l'\xe9chographie \xe0 diagnostiquer un \xe9panchement abdominal liquidien afin d'orienter les patients instables vers une laparotomie urgente [38] [39] [102] [103]. Le diagnostic \xe9chographique d'\xe9panchement liquidien est simple et peut \xeatre r\xe9alis\xe9 avec une courbe d'apprentissage faible par des m\xe9decins non radiologues, avec une sensibilit\xe9 et une sp\xe9cificit\xe9 proches de 100 % [103] [104] [105]. Ce diagnostic est utile en traumatologie pour d\xe9cider d'une laparotomie urgente chez un patient choqu\xe9. Cette d\xe9tection rapide d'\xe9panchement liquidien dans le contexte de l'urgence est connue sous l'appellation \xab FAST \xbb (Focused Assessment of the Sonography examination of Trauma patient). Dans ce contexte d'urgence, la recherche fine de l\xe9sion d'organe plein (rate, foie) est inutile car, m\xeame avec des m\xe9decins entra\xeen\xe9s utilisant des machines performantes, l'\xe9chographie sous-estime 20 \xe0 60 % de l\xe9sion d'organes pleins par rapport \xe0 la tomodensitom\xe9trie [106]. En pratique, un \xe9panchement liquidien appara\xeet comme hypo\xe9chog\xe8ne au niveau des 2 fosses iliaques, de la r\xe9gion inter h\xe9pato-r\xe9nale (espace de Morisson) (fl\xe8che) et de la r\xe9gion p\xe9rispl\xe9nique.\n",null,null,B.a0,null,null,null,null,null,null)
B.acJ=new A.w("Diagnostic d'\xe9panchement p\xe9riton\xe9al liquidien. \xc9chographie FAST montrant un \xe9panchement p\xe9rih\xe9patique et de l'espace de Morisson (fl\xe8che) (image de gauche) et pelvien (image de droite). \xc0 droite, les images punctiformes hyper\xe9chog\xe8nes au sein de l'\xe9panchement laissant \xe9voquer un \xe9panchement h\xe9morragique. Noter que l'image de gauche est obtenue tr\xe8s simplement avec la sonde d'\xe9chographie cardiaque. E = \xe9panchement p\xe9riton\xe9al ; F = foie ; D = diaphragme ; R = rein ; E' = discret \xe9panchement pleural.","assets/images/pathologies/divers/echo/22diagepanchementperitoneal.gif",null)
B.bf9=new A.a("Position intragastrique de la sonde nasogastrique\nDans un travail r\xe9alis\xe9 chez 35 patients de r\xe9animation, l'\xe9chographie permet de localiser la position intragastrique d'une sonde gastrique \xe0 extr\xe9mit\xe9 m\xe9tallique avec une sensibilit\xe9 de 97 % [37]. Ceci permet d'\xe9viter des clich\xe9s radiologiques, plus longs, plus co\xfbteux et irradiants.\n",null,null,B.a0,null,null,null,null,null,null)
