B.b17=new A.a("Une \xe9tude r\xe9cente sugg\xe8re que le seuil de collapsibilit\xe9 classique de la VCI de 50 % devrait \xeatre revu \xe0 la baisse pour une valeur critique de 40 % [50].\n\n\xc9chographie Doppler cardiaque en r\xe9animation : r\xe9alisation pratique\nL'\xe9chographie cardiaque est le plus souvent r\xe9alis\xe9e en r\xe9animation polyvalente pour le bilan et le monitorage (examens r\xe9p\xe9t\xe9s) d'une insuffisance circulatoire aigu\xeb et/ou d'une dyspn\xe9e. Les diagnostics plus sp\xe9cialis\xe9s tels que les endocardites ou les complications de la chirurgie cardiaque ne seront pas abord\xe9s ici. Il est important d'avoir une d\xe9marche syst\xe9matique qui soit toujours la m\xeame, tr\xe8s simple au d\xe9but de l'apprentissage. Pour simplifier l'expos\xe9, nous n'aborderons que les bases des pathologies courantes en adoptant la d\xe9marche diagnostique adopt\xe9e dans notre unit\xe9. Cette d\xe9marche diagnostique correspond aux objectifs 1 et 2 de la pyramide des comp\xe9tences (figure 1).\n\nExiste-t-il un \xe9panchement p\xe9ricardique et ce dernier est-il responsable\nd'une tamponnade ?\n\nLe diagnostic d'\xe9panchement p\xe9ricardique repose sur la constatation d'une image hypo\xe9chog\xe8ne adjacente aux structures cardiaques. Les coupes les plus int\xe9ressantes pour ce diagnostic sont les coupes PSGA et sous-costale. G\xe9n\xe9ralement libre, un \xe9panchement p\xe9ricardique peut \xeatre cloisonn\xe9 et r\xe9aliser une tamponnade par compression localis\xe9e d'une cavit\xe9 cardiaque, pour un volume mod\xe9r\xe9. Ceci est rare mais doit \xeatre suspect\xe9 dans des cas de tuberculose et surtout apr\xe8s chirurgie cardiaque. En coupe PSGA, le rep\xe8re fondamental est celui de l'aorte thoracique descendante apparaissant comme une structure arrondie hypo\xe9chog\xe8ne situ\xe9e sous le c\u0153ur, \xe0 la jonction VG-OG (figure 10a). La ligne de r\xe9flexion p\xe9ricardique se trouve entre l'aorte thoracique descendante et le VG. Ainsi, un \xe9panchement p\xe9ricardique aura pour limite la zone situ\xe9e entre l'aorte et le VG. La connaissance des ces \xe9l\xe9ments permet d'\xe9viter le principal pi\xe8ge diagnostique qui est l'\xe9panchement pleural gauche. Dans ce cas, l'\xe9panchement passe en arri\xe8re de l'aorte (figure 10d).\n",null,null,B.a0,null,null,null,null,null,null)
