B.b2a=new A.a("-\tPr\xe9parer des seringues avec : \n    \u2022\tUne ampoule d\u2019Ac\xe9tylcyst\xe9ine\xae dans 10 ml de s\xe9rum physiologique (sur des s\xe9cr\xe9tions \xe9paisses et collantes).\n    \u2022\tUne seringue avec de la xyloca\xefne 400mg/20ml non dilu\xe9e (pour les patient vigile lors du passage des cordes vocales injecter dans le fibroscope).\n-\tSi des pr\xe9l\xe8vements doivent \xeatre faits pr\xe9parer le mat\xe9riel avant.\n    \u2022\tPour le LBA : installer le syst\xe8me de pr\xe9l\xe8vement sur le fibroscope et pr\xe9voir deux seringues \xe0 verrou remplis de 50 ml de s\xe9rum physiologique et un pot st\xe9rile o\xf9 est dispos\xe9 dessus une compresse non tiss\xe9e.\n    \u2022\tPour une brosse (uniquement en cas de contre indication au LBA) : pr\xe9voir le mat\xe9riel.\n-\tInstaller le fibroscope et le placer sur un champ st\xe9rile.\n-\tPour les patients intub\xe9s mettre en place le cale dent.\n-\tUne aspiration au pr\xe9alable doit \xeatre effectu\xe9e avant l\u2019endoscopie : rin\xe7age au s\xe9rum physiologique avant utilisation.\nIl faut appuyer \xe0 fond sur le bouton d\u2019aspiration bronchique (entendre le clic).\n-\tLe m\xe9decin introduit le fibroscope (en nasal ou dans la sonde d\u2019intubation). L\u2019IDE doit maintenir le patient en bonne position, aider le m\xe9decin et surveiller le patient (Saturation, tension, FR, agitation, coloration).\n-\tLes pr\xe9l\xe8vements : \n    \u2022\tL\u2019aspiration bronchique simple : permet d\u2019obtenir des \xe9chantillons \xe0 vis\xe9e bact\xe9riologique ou cytologique. Envoyer le bocal d\u2019aspirateur de mucosit\xe9 et en placer un autre pour l\u2019aspiration.\n    \u2022\tLe LBA : permet de rechercher un germe, on envoie de l\u2019eau dans le fibroscope puis on r\xe9aspire ce qui permet de recueillir certains germes. Le liquide sera filtr\xe9 par une compresse non tiss\xe9e avant d\u2019\xeatre mis dans le pot st\xe9rile.\n    \u2022\tLa brosse ou les biopsies (les biopsies sont faites g\xe9n\xe9ralement par les pneumologues) : la brosse ou la pince \xe0 biopsie est introduite dans l\u2019embout du fibroscope. La brosse est coup\xe9e st\xe9rilement dans le pot st\xe9rile. Les particules de biopsies sont r\xe9cup\xe9r\xe9es et mises dans un pot st\xe9rile. \n    \u2022\tPour les pr\xe9l\xe8vements BK : 2 ml au minimum sont n\xe9cessaires.\n",null,null,null,null,null,null,null,null,null)
