B.b2S=new A.a("-\tAttention \xe0 la vitesse (en ml/h) d\xe9j\xe0 en cours : risques d\u2019\xab \xe0-coup tensionnel \xbb car la vitesse (en ml/h) sera diff\xe9rente pour arriver \xe0 la dose en mg/h voulue. Faire une surveillance accrue de l\u2019h\xe9modynamique du patient sur le scope.\n\nB)\tRelai manuel (si vitesse trop basse ou dans le cadre d\u2019un changement d\u2019abord vasculaire)\n\n-\tCommencer \xe0 une petite vitesse en ayant pris soin de diminuer de m\xeame dose celle des cat\xe9cholamines en cours jusqu\u2019\xe0 arriver \xe0 l\u2019arr\xeat complet de celle-ci tout en surveillant l\u2019h\xe9modynamique du patient sur le scope.\n-\tPenser \xe0 nommer sur le PSE le nom du m\xe9dicament et sa nouvelle dilution.\n\nNB : Ne pas oublier de faire le rin\xe7age de l\u2019octopus (au plus pr\xe8s de la voie proximale) avec du NaCl \xe0 0,9% pour un \xe9ventuel changement de dilution. Utiliser la ligne V1 pour faire le rin\xe7age.\n\n4.5.4\tCas particulier : utilisation simultan\xe9e des 3 cat\xe9cholamines\n\n-\tUtiliser un octopus 3 voies, 2  lignes V2 et la ligne sp\xe9cifique \xe0 la Dobu.\n\n",null,null,null,null,null,null,null,null,null)
