B.b3W=new A.a("                \n                      \n                Modalit\xe9s:\n                  -Le verrou antibiotique est chang\xe9 toutes les 48 h pour r\xe9duire la fr\xe9quence des manipulations, en accord avec la stabilit\xe9 de la solution. Il n\u2019y a pas de b\xe9n\xe9fice \xe0 le changer toutes les 24 h. \n                  -Le CIVLD ne doit pas \xeatre utilis\xe9 pendant les 72 premi\xe8res heures du verrou et id\xe9alement pendant toute la dur\xe9e du traitement.\n                  -Si le CIVLD est l\u2019unique abord vasculaire, que son usage est indispensable et en cas d\u2019am\xe9lioration clinique, un verrou intermittent est possible apr\xe8s 72h de traitement.\n                  -En l\u2019absence d\u2019autre abord vasculaire, pour les ILC n\xe9cessitant une antibioth\xe9rapie syst\xe9mique par vancomycine, un verrou dynamique de vancomycine peut \xeatre envisag\xe9.\n                  -La dur\xe9e totale du traitement par verrou est de 10 jours.\n                \n                Modalit\xe9s par 48h:\n                  -Prelever 3mL (verrou pr\xe9c\xe9dent) puis rin\xe7age puls\xe9 avec 10mL de NaCl 0.9%\n                  - Jour H\xe9moc:\n                    - Prelever H\xe9moc a\xe9ro/ana\xe9ro\n                    - Rin\xe7age puls\xe9 avec 10mL de NaCl0.9%\n                    - Injecter 3mL de verrou\n                  - Pas le Jour H\xe9moc:\n                    - Injecter 3mL de verrou\n                      ",null,null,null,null,null,null,null,null,null)
