B.b5m=new A.a("\xc9chographie Doppler cardiaque\nG\xe9n\xe9ralit\xe9s et int\xe9r\xeat du d\xe9veloppement de l'\xe9chographie cardiaque en r\xe9animation\nL'\xe9chographie cardiaque est l'examen ultrasonique r\xe9alisable par un r\xe9animateur qui a fait l'objet du plus grand nombre de publication au cours des 15 derni\xe8res ann\xe9es [17]. Dans cette p\xe9riode, pr\xe8s de 250 articles consacr\xe9s au sujet ont \xe9t\xe9 publi\xe9s. La pertinence des outils classiques d'exploration h\xe9modynamique est actuellement remise en question avec l'absence de b\xe9n\xe9fice d\xe9montr\xe9 du cath\xe9ter art\xe9riel pulmonaire (CAP) apr\xe8s 30 ans d'utilisation [44] et la mauvaise performance des pressions intravasculaires pour pr\xe9dire la r\xe9ponse au remplissage [45] [46]. Bien que l'impact sur la mortalit\xe9 n'ait pas \xe9t\xe9 \xe9tudi\xe9, certains travaux sugg\xe8rent que la performance de l'\xe9chographie est sup\xe9rieure au CAP [10]. Dans une \xe9tude portant sur 20 patients en insuffisance circulatoire aigu\xeb apr\xe8s chirurgie cardiaque, les auteurs ont compar\xe9 la performance diagnostique de cinq praticiens utilisant le CAP et cinq praticiens utilisant l'\xe9chographie trans\u0153sophagienne (ETO). Les r\xe9sultats de ce travail montrent que le score diagnostique moyen de l'ETO est meilleur que celui du CAP. De fa\xe7on surprenante, malgr\xe9 le caract\xe8re op\xe9rateur-d\xe9pendant de l'\xe9chographie, il existait une meilleure homog\xe9n\xe9it\xe9 diagnostique entre les 5 \xe9chographistes qu'entre les 5 h\xe9modynamiciens. Dans cette \xe9tude, 34 % de d\xe9cisions th\xe9rapeutiques majeures \xe9taient d\xe9cid\xe9es sur les seules donn\xe9es \xe9chographiques et avaient \xe9t\xe9 ignor\xe9es par le CAP. Une seconde \xe9tude men\xe9e chez 130 patients apr\xe8s pontage aorto-coronaire montre que l'\xe9valuation clinique associ\xe9e aux donn\xe9es du CAP est en concordance avec l'ETO dans 98 % des cas lorsque la fonction myocardique est normale [47]. A contrario, dans ce travail, le diagnostic de dysfonction systolique s\xe9v\xe8re (fraction d'\xe9jection ventriculaire gauche [FEVG] < 40 %) ainsi que les valeurs extr\xeames de pr\xe9charge (hypo- ou hypervol\xe9mie) est m\xe9diocre pour l'analyse clinique et par CAP et sans aucune corr\xe9lation avec les donn\xe9es \xe9chographique. Si l'ETO offre l'avantage d'une qualit\xe9 d'image sup\xe9rieure \xe0 l'ETT et ce particuli\xe8rement apr\xe8s chirurgie cardiaque, les imp\xe9ratifs de d\xe9contamination des sondes et l'usage d\xe9licat voire impossible de l'ETO chez le patient non ventil\xe9 limitent significativement son utilisation pluriquotidienne en r\xe9animation polyvalente. Les progr\xe8s technologiques r\xe9cents ont heureusement permis une am\xe9lioration sensible de la qualit\xe9 des images en ETT. Dans un travail publi\xe9 en 2004 portant sur 100 ETT r\xe9alis\xe9es pour bilan d'\xe9tat de choc, l'\xe9chog\xe9nicit\xe9 \xe9tait consid\xe9r\xe9e comme bonne chez 99 % des patients [9]. Dans ce travail, l'ETT permettait d'exclure ou d'affirmer une origine cardiog\xe9nique d'\xe9tat de choc avec une sensibilit\xe9, une sp\xe9cificit\xe9, une valeur pr\xe9dictive n\xe9gative et positive de 100 %, 95 %, 97 %, 100 %, respectivement. L'ETT permettait dans cette \xe9tude 51 % de modifications th\xe9rapeutiques significatives, dont 25 % de proc\xe9dures chirurgicales ou invasives pour une population de patient majoritairement cardiologique. Dans un travail analogue, 467 patients admis en r\xe9animation m\xe9dicale pour des pathologies non cardiaques ont \xe9t\xe9 \xe9valu\xe9s par ETT dans les 18 heures suivant l'admission [8]. Les r\xe9sultats de cette \xe9tude montrent que 36 % des patients ont une anomalie cardiaque significative qui n'a pas \xe9t\xe9 d\xe9tect\xe9e cliniquement dans plus de 75 % des cas. Dans ce travail, la pr\xe9sence d'une anomalie cardiaque \xe9chographique n'influe pas sur la mortalit\xe9 mais est associ\xe9e \xe0 un allongement de la dur\xe9e de s\xe9jour.\n\nCompte tenu de sa simplicit\xe9 de mise en \u0153uvre et de son innocuit\xe9, l'ETT constitue le moyen id\xe9al de se former \xe0 l'\xe9chographie cardiaque en r\xe9animation. Dans la suite du texte, nous ne discuterons donc que d'\xe9chographie transthoracique qui constitue la base de l'apprentissage et le meilleur moyen d'\xe9voluer naturellement vers l'acquisition d'une comp\xe9tence en ETO.\n\nFen\xeatres acoustiques utilisables en ETT (figure 6)\nComme pour les foyers d'auscultation cardiaque, les images d'\xe9chographie cardiaques sont recueillies au niveau de cinq r\xe9gions thoraciques offrant une moindre r\xe9sistance \xe0 la p\xe9n\xe9tration des ultrasons, appel\xe9es fen\xeatres acoustiques. Les fen\xeatres parasternales, apicales et sous-costales sont les trois voies pr\xe9f\xe9rentielles en r\xe9animation. Pour chacune de ces trois fen\xeatres, la rotation de la sonde sur son grand axe permet d'obtenir des plans de coupes diff\xe9rents. Ainsi, pour une fen\xeatre donn\xe9e, il existe plusieurs plans de coupe d\xe9finissant les principales coupes \xe9chocardiographiques.\n",null,null,B.a0,null,null,null,null,null,null)
