B.b5W=new A.a("-\tCatherine Lelong, (2018). Protocole Fibroscopie (R\xe9f : Pro. 10/2018/R\xe9a).\n-\tMotais C. et Fahey C. (2012). Protocole Fibroscopie bronchique de l\u2019h\xf4pital Saint Antoine. \n-\tFebvre et al. (2007). Les bonnes pratiques de la bronchoscopie courte. Elsevier Masson. Revue des Maladies Respiratoires. Rev Mal Respir 2007 ; 24 : 1363-92.\n-\tANNEXE I au DIPL\xd4ME D\u2019\xc9TAT D\u2019INFIRMIER. R\xe9f\xe9rentiel d\u2019activit\xe9s. BO Sant\xe9 \u2013 Protection sociale \u2013 Solidarit\xe9s no 2009/7 du 15 ao\xfbt 2009, Pages 258 \xe0 265.\n                  ",null,null,null,null,null,null,null,null,null)
B.b5Y=new A.a("    -\tInjecter les drogues d\u2019induction en IVD suivant la prescription m\xe9dicale \xe0 l\u2019instant d\xe9termin\xe9 par le m\xe9decin (injecter d\u2019abord l\u2019hypnotique puis le curare).\n    -\tLe m\xe9decin intube le patient \xe0 l\u2019aide du laryngoscope.\n    -\tMan\u0153uvre de Burp ou de Sellick si besoin. (Cf. annexe2).\n    -\tUne fois la SIOT en place, gonfler le ballonnet avec la seringue de 10 cc remplie d\u2019air. \n    -\tBrancher la capnographie et le BAVU sur la SIOT.\n    -\tS\u2019assurer que la courbe de la capnographie soit correcte. Auscultation par le m\xe9decin avec le st\xe9thoscope.\n    -\tSi la sonde est en place, avec l\u2019accord du m\xe9decin, brancher le patient sur le respirateur et d\xe9marrer la ventilation.\n    -\tIdentifier le rep\xe8re aux l\xe8vres de la SIOT et la fixer avec le cordon et le sparadrap.\n    -\tV\xe9rifier la pression du ballonnet \xe0 l\u2019aide du manom\xe8tre (30 cm H2O).\n    -\tPoser la SNG sur consigne du m\xe9decin et la fixer au tube avec un bout de sparadrap. \n",null,null,null,null,null,null,null,null,null)
