B.bcc=new A.a("    -\tPr\xe9parer et d\xe9marrer les traitements pour l\u2019entretien de la s\xe9dation suivant la prescription m\xe9dicale. Si besoin, une canule de Guedel se trouve dans le kit d\u2019intubation (dans le cas o\xf9 un patient mord sa SIOT et que cela emp\xeache d\u2019assurer une ventilation efficace).\n    -\tMettre le patient en proclive \xe0 30\xb0 et lui attacher les poignets avec les contentions sur prescription m\xe9dicale le temps de l\u2019impr\xe9gnation des s\xe9dations (penser \xe0 r\xe9\xe9valuer la n\xe9cessit\xe9 des contentions en fonction du RASS). \n    -\tFaire une radio de contr\xf4le.\n    -\tFaire des GDS 30 min apr\xe8s l\u2019intubation.\n    -\tAdapter le monitorage et les param\xe8tres d\u2019alarmes du scope et du respirateur en fonction du patient.\n    -\tTracer sur ICCA la totalit\xe9 de la proc\xe9dure et les traitements inject\xe9s.\n",null,null,null,null,null,null,null,null,null)
B.bcd=new A.a("4.5.1\tPr\xe9paration de la ligne des cat\xe9cholamines\n\n-\tUtiliser les 4 premiers PSE au plus pr\xe8s de la base intelligente (les relais ne seront pas accept\xe9s par la base intensive si PSE trop en hauteur)\n-\tUtiliser le V3 pour l\u2019instauration des cat\xe9cholamines (sauf dobu : ligne avec clamp).\n-\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n-\tPr\xe9parer la seringue de cat\xe9cholamines.\n-\tMonter les 2 octopus du V3 avec le prolongateur entre les 2, l\u2019octopus le plus court sera celui o\xf9 sera branch\xe9 les seringues .\n-\tPr\xe9parer une seringue de 10 ml avec du NaCl \xe0 0,9% pour purger la 1\xe8re ligne de l\u2019octopus qui servira ult\xe9rieurement (soit \xe0 un changement de dilution ou au rin\xe7age de la voie).\n-\tPurger cette voie avec le NaCl \xe0 0,9% et clamper.\n",null,null,null,null,null,null,null,null,null)
