B.bde=new A.a("Avant branchement, tester la voie proximale en faisant un reflux \xe0 l\u2019aide d\u2019une seringue de 10 ml puis faire un rin\xe7age puls\xe9 et enfin connecter la ligne de cat\xe9cholamines pr\xe9alablement pr\xe9par\xe9e et purg\xe9e.\n\nBien souvent la prescription m\xe9dicale pour d\xe9buter les cat\xe9cholamines est de 0,5 mg/h, pr\xe9f\xe9rer alors la dilution 10mg/50ml car plus la vitesse est importante plus le m\xe9dicament arrivera vite au patient lors de l\u2019instauration.\nUn changement de dilution sera \xe0 effectuer si dose > ou <.\n\nNB : Ne pas d\xe9passer 1mg/h sur les VVP car risque de n\xe9crose des veines.\nSi sevrage impossible, voir avec le r\xe9animateur pour la mise en place d\u2019un CVC.\nPour la Dobu : peut se passer sur VVP mais seule. Ne n\xe9cessite pas de faire un relai car pas de risque de fluctuation h\xe9modynamique au changement de SAP.\n",null,null,null,null,null,null,null,null,null)
