B.bej=new A.a("R\xe9alisation pratique et valeurs normales (figure 25)\nLe DTC permet, pour un op\xe9rateur entra\xeen\xe9, une \xe9tude compl\xe8te de la circulation c\xe9r\xe9brale en utilisant 3 fen\xeatres acoustiques (temporale, occipitale et orbitaire) permettant le recueil des flux des art\xe8res c\xe9r\xe9brales ant\xe9rieures, moyennes, post\xe9rieures, vert\xe9brales, tronc basilaire et communicantes [109] [110]. En pratique clinique, les flux de l'ACM recueillis par la fen\xeatre temporale (figure 25) sont les plus utilis\xe9s car ils repr\xe9sentent environ 60 % du d\xe9bit sanguin c\xe9r\xe9bral et sont relativement ais\xe9s \xe0 obtenir avec la technique d\xe9crite ci-dessus. Pour les techniques de Doppler portable, o\xf9 le flux est recherch\xe9 \xe0 l'aveugle, au son, il est important de garder \xe0 l'esprit que la profondeur moyenne du flux de l'ACM est \xe0 47 \xb1 6 mm chez le volontaire sain [111]. Le recueil du flux de l'ACM en Doppler puls\xe9 permet la mesure des vitesses systolique (Vs), diastolique (Vd), le calcul de la vitesse moyenne (Vm) et de l'index de pulsatilit\xe9 (IP) [112]. Les valeurs normales de ces param\xe8tres sont r\xe9sum\xe9es dans le tableau IV. Plus l'angle entre l'axe de tir Doppler et le flux est important (angle d'insonation), plus les vitesses sont sous-estim\xe9es. Pour une mesure sur le m\xeame site, les vitesses les plus \xe9lev\xe9es correspondent donc aux valeurs les plus proches de la r\xe9alit\xe9, mesur\xe9es avec l'angle d'insonation le plus faible. En pratique, un angle de 0 \xe0 30o constitue une limite acceptable, car l'erreur de mesure maximale reste inf\xe9rieure \xe0 15 % [107] [113]. Le rep\xe9rage couleur permet une bonne appr\xe9ciation visuelle de l'angle d'insonation : l'axe de tir Doppler doit \xeatre le plus parall\xe8le au flux couleur. L'index de pulsatilit\xe9 offre l'avantage d'\xeatre ind\xe9pendant de l'angle d'insonation. Un index de pulsatilit\xe9 \xe9lev\xe9 (> 1,2) signe un d\xe9faut grave de perfusion c\xe9r\xe9brale. Lorsque la fen\xeatre temporale n'est pas exploitable, le flux de la carotide interne intracr\xe2nienne peut \xeatre analys\xe9 par voie transorbitaire : ce flux, positif, est obtenu \xe0 une profondeur de 60-80 mm et fournit des renseignements analogues au flux de l'ACM. S'il existe un doute sur un vasospasme, le rapport entre les vitesses des flux de l'ACM et de l'art\xe8re carotide interne (ACI) dans sa portion extracr\xe2nienne peut \xeatre utile (index de Lindegaard = IL) [114]. Le flux de l'art\xe8re carotide interne dans sa portion extracr\xe2nienne est enregistr\xe9 par voie sous-mandibulaire en orientant la sonde parall\xe8lement \xe0 la branche montante de la mandibule. Par cette voie, le flux de l'ACI est obtenu \xe0 une profondeur de 40-60 mm [109] [110].\n",null,null,B.a0,null,null,null,null,null,null)
