B.bg5=new A.a("-\tR\xe9installer le patient.\n-\tPatients vigiles : les laisser \xe0 jeun pendant 3h car risque de fausse route.\n-\tPatients intub\xe9s : descendre progressivement la FiO2 jusqu\u2019\xe0 saturation cible et remettre la PEP. R\xe9gler \xe0 nouveau les alarmes du respirateur.\n-\tDemander une radiographie de contr\xf4le.\n-\tJeter le mat\xe9riel utilis\xe9, nettoyer le mat\xe9riel avant de sortir le chariot de la chambre. Nettoyer l\u2019\xe9cran avec des lingettes CIDALKAN.\n-\tEnvoyer les pr\xe9l\xe8vements bact\xe9riologiques avec les bons remplis selon la prescription m\xe9dicale.\n-\tLe fibroscope peut se conserver 4h apr\xe8s l\u2019examen apr\xe8s l\u2019avoir rinc\xe9 avec 250 ml d\u2019eau st\xe9rile. \n-\tSurveillance accrue du patient pendant l\u2019heure suivant l\u2019examen, laisser un crachoir \xe0 proximit\xe9 pour surveiller les expectorations.\n-\tReporter sur ICCA l\u2019heure du d\xe9but et de fin de la fibroscopie ainsi que toutes les informations notables survenues au cours de l\u2019examen. Tracer la fibroscopie dans les actes au lit.\n",null,null,null,null,null,null,null,null,null)
