B.bgt=new A.a("                \n                \n                Strat\xe9gies th\xe9rapeutiques:\n                  -Colonisation du CIVLD: traitement par verrou antibiotique seul durant 10 jours.\n                  -Infection probable (cf diapo 4) \xe0 staphylocoque \xe0 coagulase n\xe9gative ou \xe0 ent\xe9rocoque: traitement par verrou antibiotique seul durant 10 jours. sauf si:\n                    Neutrop\xe9nie f\xe9brile\n                    Persistance d\u2019une fi\xe8vre \xe0 48h de cette strat\xe9gie et/ou apparition d\u2019h\xe9mocultures p\xe9riph\xe9riques positives.\n                    Dans ces deux situations, adjonction d\u2019une antibioth\xe9rapie syst\xe9mique active sur le microorganisme identifi\xe9.\n                \n                  -Infection probable (cf diapo 4) \xe0 BGN: antibioth\xe9rapie syst\xe9mique indispensable\n                      ",null,null,null,null,null,null,null,null,null)
