B.bh3=new A.a("Indications:\n*Restrictifs (Scoliose, Sequelle BK)/Neuromusculaire(Myopathe, Polio):\n- CV < 40-50% th\xe9orique\n- GDS Hypoventilation alv\xe9olaire\n- Hypercapnie >45mmHg\n- SaO2 <= 88% pendant plus de 5min (souvent normoxique)\n\n*SOH:\n- Ob\xe9sit\xe9 IMC>30\n- PCO2 >45 mmHg\n- pas d'autre cause d'hypoventilation alveolaire ( mais souvent un SAOS associ\xe9)\n\n*BPCO:\n- PaCO2 >55mmHg\n- Instabilit\xe9 clinique ou gazom\xe9trique\n- Fr\xe9quence elev\xe9 de H\xb0 pour d\xe9compensation\n\n\n\n\nPrise En Charge\nGDS:\n- Le soir avant VNI: \xe9tat de base\n- Le matin apr\xe8s VNI : B\xe9n\xe9fice de la VNI\n\nD\xe9cision de VNI:\nPrendre en compte:\n- Crit\xe8re clinique\n- Capacit\xe9 cognitive\n\nInterface:\nEn chronique proposer plutot le nasale que nasobuccal ( tendance a l'appui mentonier qui augmente obstruction)\n\nSOH \nMortalit\xe9 \xe0 4 ans non n\xe9gligeable si on n'agit pas sur le SOH\nPenser a d\xe9pl\xe9ter car atteinte cardiovasculaire importante.\nVNI>PPC si s\xe9v\xe8re (PaCO2>50mmHg) -> Am\xe9lioration plus rapide\nSinon PPC (PaCO2 <50mmHg): bien tol\xe9r\xe9 ( + de confort) 11 \xe0 14 EPAP\nNe pas r\xe9\xe9valuer trop vite ( en g\xe9n\xe9ral \xe0 3mois car am\xe9liroation progressive)\n\nBPCO\nVNI toujorus en compl\xe9ment de OLD\n\n\nR\xe9glages:\n-FR minimale de rattrapage = -2 / FR spontan\xe9e ( en g\xe9n\xe9rale 12 \xe0 14)\n- Trigger chez RESMED (Lumis, Stellar) \xe0 comprendre sensibilit\xe9 de trigger: Tr\xe9s haute (=Tr\xe8s sensible) \xe0 Tr\xe8s Faible \n- Cyclage chez RESMED \xe0 comprendre Tr\xe8s Haute sensibilit\xe9: Pr\xe9coce , Tres Faible Sensibilit\xe9: Tardif\n- TI Restrictif 0.8-1.8 (tardif)\n- TI BPCO 0.6-1.0 (pr\xe9coce)\n- TI max 1.5-1.8\n- Pente plutot rapide\n\nCrit\xe8res d'observance: VNI 4h la nuit\n\nM\xe9canisme:\n- Repose muscle respiratoire\n- Augmente la compliance\n- Homogeneit\xe9 VA/Q\n\n\nMode:\nProblemes du Volum\xe9trique:\n- Gestion des fuites (compensation faible)\n- Circuit plus encombrant\n- moins d'interface disponible\n\nLes diff\xe9rents modes barom\xe9triques:\n- Spontan\xe9e\n- Tim\xe9\n- ST Spontan\xe9e et Tim\xe9\n- AVAPS: Equivalent VCRP Mode en pression avec volume cible mais \xe9tude montre plsu de r\xe9veil et moins bonne qualit\xe9 du sommeil\n- Autopilot\xe9 PEP: R\xe9sultat moyen . Finalement plus de r\xe9glage et pas beaucoup plus performant. Utilisation pour titration  si prise en charge ambulatoire avec volume cible puis r\xe9glage en pression fixe\n\nPr\xe9diction d'une exacerbation:\nLes patients ont tendance \xe0 augmenter leur FR moyenne les derniers jours avant mais ROC 0.6/0.7\n                \n                ",null,null,null,null,null,null,null,null,null)
