B.bmC=new A.a("-La fibroscopie bronchique ou bronchoscopie est un examen peu invasif, qui sert \xe0 explorer la trach\xe9e et les bronches d\u2019une personne en introduisant dans l\u2019arbre bronchique un fibroscope afin de visualiser des anomalies et de r\xe9aliser des pr\xe9l\xe8vements.\n\nLBA : lavage broncho-alv\xe9olaire\nBPCO : bronchopneumopathie chronique obstructive\nNaCl : Chlorure de sodium\nFR : fr\xe9quence respiratoire\nPEP : pression expiratoire positive\nMHC : Masque \xe0 haute concentration\nFio2 : Fraction inspir\xe9e en oxyg\xe8ne\n",null,null,null,null,null,null,null,null,null)
B.bmB=new A.a("Annexe 2 :  Man\u0153uvre de BURP et Sellick\nLa man\u0153uvre \xabBURP\xbb (backwards, upwards and rightwards pressure) est une technique utilis\xe9e lors de l'intubation trach\xe9ale sous laryngoscopie, qui permet d\u2019am\xe9liorer l'exposition de la glotte, gr\xe2ce \xe0 un d\xe9placement du cartilage thyro\xefdien du patient dans un mouvement en premier lieu post\xe9rieur puis vers le haut. \nElle ne doit pas \xeatre confondue avec la man\u0153uvre de Sellick ou compression laryng\xe9e, qui permet d'\xe9viter la r\xe9gurgitation lors de l'intubation.\n\n",null,null,null,null,null,null,null,null,null)
