B.bo_=new A.a("Estimation de param\xe8tres dynamiques de pr\xe9charge\n\nVariations respiratoires du diam\xe8tre de la veine cave\n\nL'\xe9valuation de la veine cave sup\xe9rieure (VCS) n'est possible qu'en ETO. Il est d\xe9montr\xe9 que le diam\xe8tre de la VCS conna\xeet des variations (maximales \xe0 l'exsufflation et minimales \xe0 l'insufflation) lors de la ventilation m\xe9canique [61]. Il est ainsi d\xe9montr\xe9 que, comme pour le VVS, chez des patients en choc septique sous ventilation m\xe9canique, un index de collapsibilit\xe9 ([diam\xe8tre maximum VCS - diam\xe8tre minimum VCS] / diam\xe8tre maxi VCS) sup\xe9rieur \xe0 36 % pr\xe9dit (sensibilit\xe9 et une sp\xe9cificit\xe9 90 % et 100 %) une augmentation significative du d\xe9bit cardiaque apr\xe8s remplissage vasculaire [43].\n\nL'\xe9valuation de la veine cave inf\xe9rieure (VCI) se fait par ETT (coupe sous-costale). De la m\xeame mani\xe8re que pour la VCS, le diam\xe8tre de la VCI d\xe9pend de sa pression de distension (maximum \xe0 l'insufflation et minimum \xe0 l'exsufflation), qui elle est \xe9gale \xe0 la diff\xe9rence entre la pression intravasculaire et la pression intra-abdominale. Lors du choc septique sous ventilation m\xe9canique, l'index de distensibilit\xe9 de la VCI ([diam\xe8tre maximum VCI - diam\xe8tre minimum VCI] /diam\xe8tre maxi VCI) sup\xe9rieur \xe0 18 % pr\xe9dit une augmentation significative du d\xe9bit cardiaque apr\xe8s remplissage vasculaire avec une sensibilit\xe9 et une sp\xe9cificit\xe9 de 90 % [42] [62]. Le diam\xe8tre absolu de la VCI n'a d'int\xe9r\xeat que s'il est inf\xe9rieur \xe0 12 mm. Dans ce cas, une r\xe9ponse positive \xe0 l'expansion vol\xe9mique peut \xeatre attendue [42]. Pour les valeurs sup\xe9rieures, le diam\xe8tre absolu de la VCI ne permet pas de pr\xe9dire la r\xe9ponse \xe0 l'expansion vol\xe9mique [42]. Une limitation \xe0 l'utilisation pourrait \xeatre une pression intra-abdominale \xe9lev\xe9e. Plusieurs \xe9tudes ont d\xe9montr\xe9 que les variations respiratoires de la veine cave inf\xe9rieure pour pr\xe9dire la r\xe9ponse au remplissage est d'apprentissage simple et constitue un outil non invasif pr\xe9cieux pour le r\xe9animateur \xe0 la phase pr\xe9coce des \xe9tats de choc, tant chez l'adulte que chez l'enfant [63] [64] [65].\n\nVariations respiratoires du volume d'\xe9jection systolique par \xe9tude des int\xe9grales temps-vitesses en Doppler cardiaque\n\nLa ventilation m\xe9canique en pression positive modifie les conditions de charge des deux ventricules. En augmentant la pression pleurale, l'insufflation m\xe9canique diminue le retour veineux et donc la pr\xe9charge du ventricule droit (VD) et augmente la postcharge du VD, ce qui diminue le VES du VD. Par voie de cons\xe9quence, la pr\xe9charge du ventricule gauche (VG) diminuera durant l'expiration suivante selon le temps de transit pulmonaire du sang et entra\xeenera une baisse du VES du VG. D'autres m\xe9canismes sont mis en jeu durant l'insufflation m\xe9canique (augmentation \xe0 l'insufflation de la pr\xe9charge du VG, diminution \xe0 l'insufflation de la postcharge du VG) mais des donn\xe9es exp\xe9rimentales et cliniques sugg\xe8rent qu'ils n'ont qu'un r\xf4le mineur sur les variations respiratoires du volume d'\xe9jection systolique, m\xeame en cas de dysfonction systolique [66].\n\nEn ETT, cette hypoth\xe8se a \xe9t\xe9 v\xe9rifi\xe9e, chez le lapin (sous ventilation m\xe9canique), par la mesure Doppler de la variation respiratoire de l'int\xe9grale temps-vitesse (\u0394ITV) \xe0 l'anneau aortique (ITV = int\xe9grale des vitesses du flux aortique en fonction du temps). L'ITV sous-aortique peut \xeatre consid\xe9r\xe9e comme un reflet direct du volume d'\xe9jection systolique car ce dernier s'obtient par le produit de la surface de la chambre d'\xe9jection sous aortique par l'ITV. \u0394ITV \xe9tait un indice sensible de vol\xe9mie et de pr\xe9dictibilit\xe9 de r\xe9ponse au remplissage vasculaire [67]. En ETO, d'autres auteurs ont utilis\xe9 les variations respiratoires de la vitesse maximale aortique (\u0394 Vpeak) chez des patients en choc septique, sous ventilation m\xe9canique. Un seuil de 12 % permet d'identifier les r\xe9pondeurs (\u0394 Vpeak > 12 %) et les non-r\xe9pondeurs (\u0394 Vpeak < 12 %) avec une valeur pr\xe9dictive positive de 91 % et une valeur pr\xe9dictive n\xe9gative de 100 % [41]. Les variations respiratoires du volume d'\xe9jection systolique sont bien corr\xe9l\xe9es aux variations de surface ventriculaire gauche en petit axe mesur\xe9s par d\xe9tection automatique des contours semblent \xe9galement fiables pour pr\xe9dire les effets de l'expansion vol\xe9mique [68].\n\nEstimation de la pr\xe9charge-d\xe9pendance par \xe9tude des variations de l'ITV\nsous-aortique apr\xe8s man\u0153uvre de lever de jambes\n\nCette man\u0153uvre entra\xeene un transfert de volume sanguin du secteur p\xe9riph\xe9rique vers le secteur central. La premi\xe8re \xe9tude effectu\xe9e sur le sujet a \xe9t\xe9 r\xe9alis\xe9e en 2002 et a d\xe9montr\xe9 que l'effet d'un lever de jambes de 45o sur le d\xe9bit cardiaque (mesur\xe9 par thermodilution via un cath\xe9ter art\xe9riel pulmonaire) \xe9tait \xe9quivalent \xe0 celui d'un remplissage vasculaire de 300 mL de collo\xefde [69]. L'\xe9preuve de lever de jambes (ELJ) est un indice int\xe9ressant quand on l'associe \xe0 une mesure non-invasive du d\xe9bit cardiaque par Doppler \u0153sophagien ou par mesure de l'ITV sous-aortique en \xe9chocardiographie. Cela permet une \xe9valuation pr\xe9cise de la pr\xe9charge-d\xe9pendance de fa\xe7on totalement non-invasive et sans risque de surcharge vol\xe9mique. Une augmentation de 10 % du d\xe9bit aortique par une ELJ (sp\xe9ciale car associ\xe9e \xe0 une \xe9l\xe9vation du buste de 45o) pr\xe9disait une augmentation de 15 % du d\xe9bit aortique apr\xe8s un remplissage vasculaire de 500 mL de s\xe9rum sal\xe9 \xe0 0,9 %, avec une sensibilit\xe9 de 97 % et une sp\xe9cificit\xe9 de 94 % [70]. Ce test semble utilisable m\xeame chez des patients sous ventilation m\xe9canique avec une activit\xe9 ventilatoire spontan\xe9e et en arythmie [70]. Ces r\xe9sultats ont \xe9t\xe9 r\xe9cemment confirm\xe9s chez des patients en ventilation spontan\xe9e [71] [72]. Cet indice pr\xe9sente pour certains des limites, li\xe9es au fait que l'ELJ serait susceptible de provoquer une stimulation sympathique, notamment chez les patients de chirurgie abdominale, pouvant fausser les mesures. Pour \xe9viter cet \xe9cueil, une \xe9preuve plus neutre telle que le Trendelenburg reste \xe0 \xe9valuer.\n\nExiste-t-il une fuite valvulaire massive ?\n\nLa quantification des fuites est difficile et affaire de sp\xe9cialiste. Toutefois, il est facile de diagnostiquer une fuite mitrale massive lorsque le Doppler couleur montre en coupe 4 cavit\xe9s un flux systolique bleu allant de la valve mitrale vers le bas de l'oreillette gauche (figure 13). La largeur du jet couleur \xe0 l'origine de la fuite, sa longueur et sa surface sont corr\xe9l\xe9es \xe0 la s\xe9v\xe9rit\xe9 de la fuite. Sur la valve aortique, le jet de fuite est diastolique et rouge en coupe 4 cavit\xe9s.\n",null,null,B.a0,null,null,null,null,null,null)
