B.boZ=new A.a("Les cat\xe9cholamines doivent \xeatre manipul\xe9es avec pr\xe9caution et \xeatre administr\xe9es sur une voie veineuse de tr\xe8s bonne qualit\xe9 voir une voie centrale r\xe9serv\xe9e (proximale) \xe0 cette th\xe9rapeutique.\nTout patient b\xe9n\xe9ficiant d\u2019un traitement par cat\xe9cholamine doit \xeatre plac\xe9 sous \xe9troite surveillance avec monitorage en continu, la surveillance de la pression art\xe9rielle se fait id\xe9alement avec un KTA. Le r\xe8glage des alarmes est \xe0 adapter en fonction des constantes du patient et des objectifs de PAM prescrits.\nLes variations de posologie se font progressivement tout en surveillant la PAM et la fr\xe9quence cardiaque.\n(intol\xe9rance de la Dobu = tachycardie)\n\nPREVENIR MEDECIN SI AUGMENTATION DE PLUS DE 2mg/h : notion de gravit\xe9 de l\u2019\xe9tat du patient.\n\nNB : En cas d\u2019occlusion de la tubulure ou pression \xe9lev\xe9e sur PSE , il faut rel\xe2cher la pression avant de lever l\u2019obstacle sinon risque de bolus (fermer le clamp, d\xe9sadapter le prolongateur, laisser \xe9couler le produit sur une compresse, rebrancher le prolongateur, d\xe9clamper la voie et redemarrer le PSE).\n",null,null,null,null,null,null,null,null,null)
