B.bsg=new A.a("L\u2019intubation est un acte m\xe9dical qui consiste \xe0 mettre en place une sonde qui est introduite sous contr\xf4le visuel, parfois endoscopique, par la bouche et positionn\xe9e dans la trach\xe9e, en passant par les cordes vocales puis maintenue par son ballonnet, permettant ainsi d\u2019\xe9viter le passage de la salive et du liquide gastrique vers les poumons (risque d\u2019inhalation). \t\nLa SIOT relie le patient au ventilateur pour suppl\xe9er la fonction respiratoire et/ou prot\xe9ger les voies a\xe9riennes. \n                          ",null,null,null,null,null,null,null,null,null)
