B.bsM=new A.a("-\tV\xe9rifier l\u2019efficacit\xe9 du syst\xe8me d\u2019aspiration bronchique (le manom\xe8tre ne doit pas d\xe9passer 850 Mbar pour nos fibroscopes \xe0 Scope).\n-\tConnecter l\u2019aspirateur de mucosit\xe9s pour fibroscope au stop vide (pensez \xe0 mettre un bout de sparadrap industriel autour du stop vide pour qu\u2019il soit aspiratif en continu).\n-\tConnecter l\u2019autre bout du stop vide au fibroscope.\n-\tBrancher le fibroscope sur l\u2019\xe9cran au niveau de la fl\xe8che bleue.\n-\tAllumer l\u2019\xe9cran.\n-\tS\u2019il y a un LBA \xe0 faire : mettre l\u2019adaptateur pour fibro, puis un robinet 3 voies et enfin le prolongateur avec robinet 3 voies, qui vous servira \xe0 connecter vos seringues de 50 ml. Le robinet proximal servira par exemple \xe0 faire de l\u2019Ac\xe9tylcyst\xe9ine\xae.\n-\tSi le m\xe9decin veut faire une brosse il faudra juste placer l\u2019adaptateur du fibroscope pour glisser la brosse dedans.\n\n",null,null,null,null,null,null,null,null,null)
B.bsT=new A.a("Aide \xe0 la mise en place des cath\xe9ters vasculaires\nLa pose d'un cath\xe9ter veineux central est \xe0 l'origine de 10 % d'\xe9checs, 8 % de ponctions art\xe9rielles et 4 % de pneumothorax [73]. Ces complications sont une source non n\xe9gligeable de morbidit\xe9 et de perte de temps [74]. La visualisation de la structure vasculaire et ses rapports avec les structures adjacentes (art\xe9rielles notamment) permet de limiter les complications imm\xe9diates. La ponction de la veine jugulaire interne sous \xe9chographie permet de rep\xe9rer une atypie de position anatomique de la veine dans 16 % des cas et une thrombose chez 9 % des patients [75]. Chez des m\xe9decins entra\xeen\xe9s, la ponction de la veine jugulaire interne sous \xe9chographie permet de passer de 90 \xe0 100 % de succ\xe8s \xe0 la premi\xe8re tentative [76]. Des r\xe9sultats analogues sont retrouv\xe9s par voie sous-clavi\xe8re [77] [78]. Chez des internes, la ponction sous \xe9chographie augmente le taux de succ\xe8s de 75 \xe0 100 % \xe0 la premi\xe8re ponction [36]. Le cath\xe9t\xe9risme veineux central sous \xe9chographie permet \xe9galement de limiter les complications, notamment les pneumothorax [76] [78]. Deux m\xe9ta-analyses confirment l'am\xe9lioration des taux de succ\xe8s \xe0 la premi\xe8re ponction, et la diminution du taux de complications par le rep\xe9rage \xe9chographique [79] [80]. Le rep\xe9rage par \xe9chographie bidimensionnelle est sup\xe9rieur au rep\xe9rage par Doppler, particuli\xe8rement pour la voie sous-clavi\xe8re [79]. Le travail de Milling et al. [81] montre enfin que la ponction en temps r\xe9el sous \xe9chographie bidimensionnelle (rep\xe9rage dynamique), permettant de visualiser la position intravasculaire de l'aiguille, est sup\xe9rieure au rep\xe9rage pr\xe9alable seul, avec tra\xe7age du rep\xe8re sur la peau (rep\xe9rage statique ou Quick-look). Dans cette \xe9tude, le taux de succ\xe8s avec rep\xe9rage dynamique permet 100 % de succ\xe8s au premier essai, contre 82 % avec la technique statique et 64 % \xe0 l'aveugle.\n\nAu total, ces r\xe9sultats sugg\xe8rent que, en dehors de situations de sauvetage (qui justifient la poursuite de l'apprentissage des ponctions \xe0 l'aveugle), tout cath\xe9ter veineux central devrait \xeatre plac\xe9 sous \xe9chographie bidimensionnelle en temps r\xe9el. La r\xe9alisation routini\xe8re de pose de cath\xe9ter sous \xe9chographie semble en outre aider \xe0 l'apprentissage de la pose des cath\xe9ters \xe0 l'aveugle. Aux \xc9tats-Unis et au Royaume-Uni, les ponctions veineuses centrales sous \xe9chographie ont fait l'objet de recommandations officielles [82].\n",null,null,B.a0,null,null,null,null,null,null)
