B.btE=new A.a("L\u2019intubation est une proc\xe9dure courante mais \xe0 risque en r\xe9animation, elle augmente le risque de morbidit\xe9 et de mortalit\xe9. Elle est souvent pratiqu\xe9e dans l\u2019urgence et sur des patients instables, et n\xe9cessite donc une parfaite ma\xeetrise de l\u2019acte.\nL\u2019intubation met en jeu le pronostic vital du patient en causant des complications non n\xe9gligeables (entre 20 et 50% de risque de complications).\nL\u2019objectif de cette proc\xe9dure est de r\xe9duire les risques li\xe9s \xe0 l\u2019intubation et d\u2019am\xe9liorer les pratiques professionnelles.\n\n                          ",null,null,null,null,null,null,null,null,null)
