B.buv=new A.a("Utilisation en pathologie\nL'int\xe9r\xeat clinique du DTC a \xe9t\xe9 bien \xe9tudi\xe9 au cours des traumatismes cr\xe2niens. Au cours d'un traumatisme cr\xe2nien grave, lorsque la pression intracr\xe2nienne (PIC) augmente et que la pression de perfusion c\xe9r\xe9brale (PPC) diminue, les v\xe9locit\xe9s Doppler diminuent [115]. Les v\xe9locit\xe9s diastoliques sont les plus pr\xe9cocement alt\xe9r\xe9es, puis, en de\xe7\xe0 de 70 mmHg de PPC, l'IP augmente [115]. Il est \xe9tabli que les variations des vitesses Doppler et d'IP sont corr\xe9l\xe9es aux variations de d\xe9bit sanguin c\xe9r\xe9bral, de PPC et de PIC [109]. Ces corr\xe9lations permettent en th\xe9orie d'\xe9valuer la PIC et la PPC par DTC. Ainsi, \xe0 partir des vitesses Doppler de l'ACM, des formules permettent de calculer la PPC [PPC = pression art\xe9rielle moyenne \xd7 (Vd/Vm + 14 mmHg)] [116] [117] ou la PIC (PIC = 11,1 \xd7 PI - 1,43) [118], cette derni\xe8re formule permettant de classer les patients avec une PIC > 20 mmHg avec une sensibilit\xe9 de 89 % et une sp\xe9cificit\xe9 de 92 % [118]. N\xe9anmoins, si ces corr\xe9lations sont justes, il peut \xeatre object\xe9 que l'exactitude sur le chiffre de PPC ou de PIC obtenu est trop faible pour adapter la th\xe9rapeutique : chez plus de 10 % des malades, la diff\xe9rence entre la valeur obtenue par DTC et la PPC ou la PIC conventionnelle varie de plus de 12 mmHg, ce qui rend ces formules difficilement acceptables en clinique [109]. Il est donc hasardeux d'utiliser le DTC pour obtenir un chiffre de PPC ou de PIC. A contrario, le DTC permet la d\xe9tection rapide, semi-quantitative, non invasive d'une anomalie grave de perfusion c\xe9r\xe9brale et permet d'appliquer une th\xe9rapeutique ad\xe9quate. L'alt\xe9ration la plus simple et la plus s\xe9v\xe8re \xe0 rechercher est la chute des Vd et Vm. Des valeurs de Vd < 20-25 cm \xb7 s-1 sont corr\xe9l\xe9es \xe0 un pronostic d\xe9favorable [119] [120]. Dans une \xe9tude portant sur 121 traumatis\xe9s cr\xe2niens, une Vm de l'ACM < 30 cm \xb7 s-1 est associ\xe9e \xe0 un d\xe9c\xe8s pr\xe9coce dans 80 % des cas [115]. Dans un travail analogue portant sur 57 traumatismes cr\xe2niens graves, une Vm < 35 cm \xb7 s-1 est un facteur de mauvais pronostic. La confirmation du caract\xe8re pathologique de vitesses basses est confirm\xe9e par le calcul de l'IP : un IP \xe9lev\xe9 associ\xe9 \xe0 des vitesses basses signe une hypoperfusion c\xe9r\xe9brale grave (hypertension intracr\xe2nienne, bas d\xe9bit, hypocapnie trop s\xe9v\xe8re) [118] [121]. Dans une \xe9tude r\xe9cente, Ract et al. [119] montrent que l'utilisation combin\xe9e de la Vd, Vm et de l'IP \xe0 l'accueil des traumatis\xe9s cr\xe2niens graves permet une meilleure d\xe9tection des patients porteurs d'une hypoperfusion c\xe9r\xe9brale s\xe9v\xe8re. Dans ce travail, l'application de th\xe9rapies (noradr\xe9naline et/ou mannitol) visant \xe0 restaurer la PPC chez les patients pr\xe9sentant 2 des trois crit\xe8res suivants : Vd < 20 cm \xb7 s-1, Vm < 30 cm \xb7 s-1, IP > 1,4 permet une normalisation des flux Doppler chez 90 % des patients.\n\nLe DTC semble constituer un outil simple et non invasif permettant une \xe9valuation pr\xe9coce de la perfusion c\xe9r\xe9brale au lit du patient, toutefois, aucune \xe9tude n'a d\xe9montr\xe9 l'impact de cette technique sur le pronostic. Le tableau V r\xe9sume les profils pathologiques les plus courants.\n",null,null,B.a0,null,null,null,null,null,null)
